As a user of the BUStest on a pad, I want to be able to take photos directly from the device so that I can complete the tests without having to take all the pictures in advance and select them from the camera roll </p><p><strong>Acceptance Criteria:</strong> </p><ol><li>The user should be able to select the camera directly from the BUStest app on the Samsung Active Tab5 with Android 14. </li><li>Photos taken directly from the BUStest app should be saved and immediately available for the test. </li><li>The functionality should work in both Samsung''s default browser and Chrome. </li> </ol><p><strong>Technical Details:</strong> </p><ul><li>The issue occurs on the Samsung Active Tab5 with Android 14. </li><li>The issue is reproducible on another device with Android 14 but not on a device with Android 13. </li><li>Current behavior: The user can only choose images from the camera roll instead of taking new photos directly within the BUStest app. </li><li>Potential cause: Differences in camera handling between Android 13 and Android 14. </li> </ul><div>Note:&nbsp; </div><div><ul><li>We can add Video, but not images </li> </ul> </div><div><br> </div><div><a href="#" data-vss-mention="version:2.0,7bf83639-1073-6e35-8898-6e0fe34e2608">@Samra Aman</a><a href="#" data-vss-mention="version:2.0,f44b5306-5f4f-6607-bee6-4f272f0862ec">@Lauren Høivik</a><a href="#" data-vss-mention="version:2.0,19b8c663-a32b-607a-bcf6-adbbf400a94b">@Anders Aanje</a> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18219','{"category": "Bug"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-17 17:41:56.307+05:30','2024-07-02 12:51:15.507+05:30','2024-07-02 12:51:15.507+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-24T10:23:57.797Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-28T07:03:02.473Z"}, {"status": {"newValue": "Development In Prog