	('azure_workitems','2024-07-30 12:18:02.438642+05:30','17259','AS a PO I want to Group Presented Results for Simpler UI in full OI-report','<div><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">Once the story&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/17258">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/17258</a> , Is done we wish to explore how the presentation of errors might be organized into groupings. <br><br>For example, if there are many different types of errors related to brakes, an expandable list for these might be beneficial to simplify the UI and improve user experience.<br>( Observe <span style="font-family:&quot;.SF NS&quot;;display:inline !important;">We will evaluate this based on the outcome of the above story)&nbsp;</span><br><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">This is only for the OI website.&nbsp; </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Requirements:</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>UI:</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Categorize what should be included in each group. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Implement a UI change. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Likely involves backend adjustments. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Consumer-facing (on the Oscar side). </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Expandable list. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">Request an estimate. </p><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17259','{"category": "Task"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-22 18:13:36.91+05:30','2024-05-22 18:13:36.91+05:30','2024-05-22 18:13:36.91+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17258','Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway');
