	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18567','As a user, I want to create/edit a state report','<div><div style="box-sizing:border-box;">Important information on state report </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Defects </li><li style="box-sizing:border-box;">Pictures </li> </ul><div style="box-sizing:border-box;">User starts with defects from the valuation. </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">Preview report option should be available. </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Preview of TestLink </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Technical info: should we go with dynamic token, without storing in DB </li> </ul><li style="box-sizing:border-box;">Preview of PDF report </li> </ul><div style="box-sizing:border-box;">Need to come up with proper layout for the defects section. To be finalized. </div> </div> </div> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/374b0870-818f-4f0e-8d0c-b894c6c6065d?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br> </div><div><br> </div><div>We can start creating a state report, and until it''s getting concluded, we need to sync the changes (like defects) to there from the parent work orders and valuations. </div><div><br> </div><div><span style="display:inline !important;">User can create defects based on checkpoints similar to how it''s on valuation flow.</span><br> </div><div><br> </div><div>Once concluded it''s not updated until the user, </div><div><ul><li>Reopen the concluded valuation </li><li>Delete the existing one, and create new state report based on the same requisition </li> </ul><div>Syncing automatically, </div><div><ul><li>We need to consider external partners as well </li><li>Vidar to finalize the requirements here </li><li>We need data structure changes to support this<br> </li> </ul><div>We can consider providing an information that there are changes happened outside, and confirm whether to sync those changes (end user''s choice). </div><div><br> </div><div>After concluding unable to edit as it''s working now on P2. </div><div><br> </div><div>Properties </div><div><ul><li>Similar ones as it''s now </li><li>OBD readings </li><li>Battery test results </li> </ul><div>When creating based on previous one, we need to pre-fill the details and defects. </div><div><ul><li>All should be editable here </li> </ul> </div><div>If it''s a fresh one, it''s empty and user can start filling them. </div><div><br> </div><div>Should be able to delete a state report as well </div><div><ul><li>Even not it''s possible on P2 - Initially this was available, but now we cannot delete. To check the story related to this and update here. </li><li><span style="text-align:start;display:inline !important;">Not allowed it it''s created by external partners</span>&nbsp;- deleting these ones should also be possible on P3, but need to coordinate with them and finalize this requirement. Vidar to follow up on this. </li> </ul> </div> </div> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18567','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-27 12:23:43.597+05:30','2024-06-27 12:23:43.597+05:30','2024-06-27 12:23:43.597+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18373','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
