	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18571','As PO, I would like to apply some restrictions on image uploads','<div><span>Handle large size images generally. We can either&nbsp;</span> </div><div><span><ul><li><span>Block uploading large images</span> </li><li>Reduce the size by compressing </li><ul><li>Front end compressing would be better since we don''t have to send the large size image in that case </li><li>To avoid reducing the quality if images, we can consider k<span style="text-align:start;display:inline !important;">eeping the resolution and compress them</span> </li> </ul> </ul></span><div>Set rules, 10mb max size may be<br> </div><div><br> </div><div>Notes </div><div><ul><li><span style="">No storage problem on Azure data lake, however better to apply such restrictions</span><br> </li><li><span style="">Azure blob storage, it will run the compression by default, but w</span>e can still do the further compression on front end. </li> </ul> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18571','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-27 15:19:05.453+05:30','2024-06-27 15:19:05.453+05:30','2024-06-27 15:19:05.453+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
