	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18693','As a PO, I want to do the necessary updates in BUSpek PS to comply with SVV''s new regulations','<div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">From 1 January 2025, the control body must collect data on cars'' actual fuel consumption, so-called OBFCM data, when the cars are in for periodic checks. The control bodies must transfer this data to the Norwegian Road Administration. The Norwegian Public Roads Administration therefore wants the control body to be notified that a vehicle is applicable for reading and transferring OBFCM data, both when asking about control type and when creating a new control slip.&nbsp;</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/03757e33-4c27-449e-89cc-8004064e9815?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"></span> </li> </ul></span> </div><div style="box-sizing:border-box;"><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">From 10 June 2024, a new field stating whether the data provider must display a warning will be available in our test environment. The field will provide information that a warning must be displayed in their solutions when creating a P control and for queries on control type for vehicles that must have P control, for petrol and diesel cars (including hybrid) in the categories M1 and N1 (including M1G and N1G ) which is registered for the first time as of 2021.<span>&nbsp;</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><span style="box-sizing:border-box;">Text to be displayed:&nbsp;«Kjøretøyet er aktuelt for avlesning og overføring av OBFCM-data».</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Display a banner, same as how we display the protected vehicle&nbsp;</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Text should display in inspection creation popup, edit<span>&nbsp;</span></span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">inspection</span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">&nbsp;and vehicle search (same as the protected vehicle)</span> </li> </ul><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Need DB Changes<span>&nbsp;</span><a href="#" data-vss-mention="version:2.0,19b8c663-a32b-607a-bcf6-adbbf400a94b" style="box-sizing:border-box;text-decoration:underline;cursor:pointer;">@Anders Aanje</a>&nbsp;/<span>&nbsp;</span><a href="#" data-vss-mention="version:2.0,e01c7883-70a2-612f-aa68-d77ac340e44d" style="box-sizing:border-box;text-decoration:underline;cursor:pointer;">@Ishara Kumararathna</a>&nbsp;<span>&nbsp;</span> </li><ul><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><span>DB Change should be done on VehicleSnapshot and as well as on AutoSysDummyVehicle table&nbsp;<br></span> </li> </ul> </ul> </div> </div><br><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18693','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-07-02 14:34:52.563+05:30','2024-07-23 17:11:25.35+05:30','2024-07-23 17:11:25.35+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt"