	(NULL,'2024-07-30 12:24:37.29432+05:30','14048',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:25:36.879408+05:30','18718','As a developer, I would like to login to P3 automatically once logged into P2','<div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">First we need to come up with a mechanism to support authenticating to P3 based on the P2 sign in </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">From active and passive authentication models, we use the passive one here sine we need to get rid of the user interaction</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">Show login page is no token is available or the token is invalid. With this users are able to login directly to P3 as well</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">If token is identified as an invalid one due to IP change on client side (Eg: due to wifi network switch etc.)</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">If kept idle for long time, where token refreshing cannot be done</span> </li> </ul><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">Session storage to manage the tokens (session storage is better than local storage on this)</span> </li> </ul> </ul><div style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">Multiple tab support on P2 and P3</span></span> </div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">Sequence</span></span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">P2 - send one req to P2 server</span></span></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">P2 server call security portal</span></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">P2 serve encrypt and send to P2 client side</span></span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">To consider the cost here, and can even do the encryption on client side before storing on the session storage as well</span></span> </li> </ul><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">P2 client updates the details on session storage of the new&nbsp;<span style="box-sizing:border-box;display:inline !important;">P3 tab</span></span><br style="box-sizing:border-box;"></span></span> </li> </ul><li style="box-sizing:border-box;">Cross different tab communication </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;display:inline !important;">Shared info by Feng on Slack: About the mechanism supporting communications among tabs. It has been there in our P3 client architecture from the beginning, as we knew this type of use scenarios would occur. Currently, single sign-out/SSO is based on it on client side.</span><br style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;display:inline !important;">The mechanism is based on broadcasting. We can send a message + data from any tab and receive them in another/all other tabs.</span><span style="box-sizing:border-box;height:8px;display:block;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;"></span><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;display:inline !important;">Subscribe to receive:<img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/b65294cd-6bd2-4842-822c-dc72048e3d1d?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;display:inline !important;"><span style="box-sizing:border-box;display:inline !important;">Broadcast to publish:<img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/fb62388e-d5bf-4d6a-aa75-2d3949dd0956?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"></span><br style="box-sizing:border-box;"></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;display:inline !important;"><span style="box-sizing:border-box;display:inline !important;"><span style="box-sizing:border-box;display:inline !important;">Use the same way to achieve the communications between P2 and P3 on different tabs.</span></span></span> </li><li style="box-sizing:border-box;">We can: </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">install the library into P2 directly to publish the token; </li><li style="box-sizing:border-box;">build a component in P3 and convert it to web component, install the web component into P2, and publish the token. </li> </ul><li style="box-sizing:border-box;">Several other ways also, e.g. since P2 &amp; P3 stay in the same domain, we can directly send the existing P2 cookies from P3 client to P2 server(where P2 use session exists), to apply for a P3 token and return the token directly to P3. </li><li style="box-sizing:border-box;">But, not so appreciate this way, since it merges P2 stuff into P3. Really not so beautiful to mix these 2 platforms since earlier planned to retire P2 at all on a suitable time point. These 2 versions should not be mixed at all ideally. </li><li style="box-sizing:border-box;">Anyway, for now, let''s stick to the business requirement, to launch P3 BUStest from P2 on a new tab. </li> </ul><li style="box-sizing:border-box;">Store the token from P2 tab on P3 tab </li> </ul> </div></span> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><b style="box-sizing:border-box;">Notes:</b> </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Permissions would still be handled on P2, and we can include the permission based on the details we have on P2 </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Later we will inject the permissions from P3 end - not now on P3 BUStest </li><li style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/c167ad92-e8bb-41c0-877f-a06a624c529a?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span dir=ltr style="box-sizing:border-box;">If a token has such a P2 permission claim, it overwrites P3 permission claim. So, before we launch P3 identity platform, all P2 users can still use their P2 static roles to be authorized on P3 resources.</span></span><br style="box-sizing:border-box;"> </li> </ul><li style="box-sizing:border-box;">Token refresh should happen automatically on P3, so no need of manual update from P2<br style="box-sizing:border-box;"> </li><li style="box-sizing:border-box;">Within the valid time after a token is fetched, if a change happened on user permission it won''t be reflected immediately </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Should be ok, since even on P2 it''s not reflected real time until the logout </li><li style="box-sizing:border-box;">For now we can keep as it is, and based on feedback later, we can adapt </li> </ul> </ul> </div> </div><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18718','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-07-03 09:28:03.73+05:30','2024-07-26 08:13:20.727+05:30','2024-07-26 08:13:20.727+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-26T02:43:20.727Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18124','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
