	('azure_workitems','2024-07-30 12:22:32.566251+05:30','17511','[SEO] As a developer, I want to investigate using schema markups','<div>More details in the parent Feature. This is part of the larger change for SEO. Tasks in this story:<br> </div><div><br> </div><div><ul><li>Investigate schema markups and where we could add it to the pages. Check which types of schema markups we could use in different places in OI. </li> </ul><div>After investigation it was decided to add schema markup to the pages for FAQ and blog posts. It is added as a header property. </div><div>No other pages should have schema markup property in header. </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17511','{"category": "User Story"}',NULL,'{"category": "Business QA"}',NULL,NULL,'2024-05-31 12:51:03.083+05:30','2024-07-03 16:51:41.467+05:30','2024-07-03 16:51:41.467+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T07:58:26.417Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-06-25T06:51:38.41Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Blocked_Dev"}, "changedAt": "2024-07-01T13:33:43.29Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-02T09:59:23.333Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-02T12:16:56.563Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-03T04:08:07.763Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-03T11:21:41.467Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17266','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
