	('azure_workitems','2024-07-30 12:24:37.29432+05:30','18722','As a user, I would like to create/edit defects on the valuation page','<div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span dir=ltr style="box-sizing:border-box;"><div style="box-sizing:border-box;margin-bottom:16px;margin-top:0px;"><div style="box-sizing:border-box;"><b style="box-sizing:border-box;">Finalised AC</b> </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Here User able to add/edit defects using this window. </li><li style="box-sizing:border-box;">User able to add Images/Videos/Damage drawing and<span>&nbsp;</span><span style="box-sizing:border-box;color:rgb(200, 38, 19);"><b style="box-sizing:border-box;">audios ?</b></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">Uploaded images will be display as a image slider.</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">Using arrows user can switch between images.</span> </li><li style="box-sizing:border-box;">User able to zoom in/out, delete / edit / download image. </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">Once user click on image he will get a larger preview.&nbsp;</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">User able to zoom in/out, delete / edit / download image.</span><br style="box-sizing:border-box;"></span> </li> </ul> </ul><li style="box-sizing:border-box;">Able to add, </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Testposition (multi-select dropdown)</span><br style="box-sizing:border-box;"> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Åtgärd<span style="box-sizing:border-box;display:inline !important;">(multi-select dropdown)</span></span><br style="box-sizing:border-box;"></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Comments (textarea)</span><br style="box-sizing:border-box;"></span></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Beräknad kostnad</span><br style="box-sizing:border-box;"></span></span></span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Kostnad (input field)</span><br style="box-sizing:border-box;"></span></span></span></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Arbeid eks. mva&nbsp;<span style="box-sizing:border-box;display:inline !important;">(input field)</span></span><br style="box-sizing:border-box;"></span></span></span></span></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Deler eks. mva&nbsp;<span style="box-sizing:border-box;display:inline !important;">(input field)</span></span><br style="box-sizing:border-box;"></span></span></span></span></span></span> </li> </ul><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Kataloge info</span><br style="box-sizing:border-box;"> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">User can select a supplier (Meca etc.) from katalog dropdown and add items. (same as p2)</span> </li> </ul> </ul><li style="box-sizing:border-box;">Display&nbsp;<span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Total kostnad inthe bottom</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">options to select &quot;<span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Sum eks. mva&quot; or &quot;<span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;"></span><span style="box-sizing:border-box;">Sum ink. mva&quot;</span></span></span> </li> </ul><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">When selecting actions, we need to adjust the price based on individual standard prices set for each action</span></span></span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;">Old AC has the requirement of &quot;<span style="text-align:start;display:inline !important;">A button, labeled ''More Info +'', offering expanded details on cost breakdown or additional actions required.</span>&quot;, </span><span style="box-sizing:border-box;color:rgb(200, 38, 19);"><b>ok to put all 3 on the same row?</b></span></span></span> </li> </ul><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/b07863d1-6831-4990-9604-789826650e5f?fileName=Screenshot%202024-07-12%20at%2009.21.50.png" alt="Screenshot 2024-07-12 at 09.21.50.png" width=297 height=376 style="box-sizing:border-box;max-width:100%;align-self:center;width:297px;height:376px;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/8795e300-5c52-4c05-bd92-110ff4ca561d?fileName=Screenshot%202024-07-12%20at%2009.22.13.png" alt="Screenshot 2024-07-12 at 09.22.13.png" width=323 height=400 style="box-sizing:border-box;max-width:100%;align-self:center;width:323px;height:400px;"><br style="box-sizing:border-box;"> </div> </div><div style="box-sizing:border-box;"><br> </div> </div><p style="box-sizing:border-box;margin-bottom:16px;margin-top:0px;"><b>Initial AC:</b> </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:0px;"><br>Design a detailed component for logging and assessing vehicle defects within an inspection software, with a focus on non-approved aftermarket products, specifically steering wheels. This module should provide an interface for attaching relevant files with tabs for ''Images'', ''Video'', and ''Damage Report''. There should be a drag-and-drop area as well as buttons for ''Upload'' and ''Open Camera''. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">The ''Test Position'' section allows the user to select the position of the defect from dropdown options such as ''Rear'', ''Front'', ''Inner'', and an ''All test positions'' checkbox for quick selection. Accompanying this, a notes field provides space for additional observations. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">The ''Action'' section requires a decision on the course of action, like ''Replace'', with a dropdown menu for possible actions predefined by the admin. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">The ''Estimated Cost'' section is dynamically populated based on the selected ''Action''. If the admin has set a standardized price for this action, the cost field auto-fills with this value. A button, labeled ''More Info +'', offering expanded details on cost breakdown or additional actions required. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">Lastly, include a choice for displaying the total cost exclusive or inclusive of VAT, with the total cost prominently displayed. An option to fetch pricing from an external catalog, linked with ''Open Catalog'', provides further cost details from ''Meca Webshop'' or similar linked sources. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">Implement front-end logic to auto-fill the ''Estimated Cost'' based on admin-provided data, and ensure that the ''More Info'' button reveals hidden fields or documentation for in-depth cost analysis. The interface should be user-friendly, facilitating easy navigation through sections, with a responsive design for desktop and mobile devices. </p><div style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/2f277b34-bd42-4727-9d96-3b6773681903?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"> </div></span></span>When expanding More Info, the below 2 fields should be shown. </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/336bc24b-8b73-45e2-aaf0-fb5a0bdd80ea?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span dir=ltr style="box-sizing:border-box;"><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;"><span style="box-sizing:border-box;">Create a section in a vehicle service application that allows users to import pricing details for parts or services from an external accessories catalog. Title this section ''Fetch Price from Catalog'', with a direct link titled ''Open Catalog'' that opens the ''Meca Webshop'' or a similar external resource in a new tab or window.</span><br style="box-sizing:border-box;"> </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;"><span style="box-sizing:border-box;"><span dir=ltr style="box-sizing:border-box;"></span></span> </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">Below the link, include a dropdown menu where the user can select the source of the pricing, in this case, pre-populated with ''Meca Webshop''. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">Beneath the dropdown, display a summary section titled ''Overview of Fetched Prices''. This part of the interface will dynamically list each item imported from the catalog, showing: </p><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;margin-bottom:0px;margin-top:0px;">The name of the shop, ''Meca Webshop''. </li><li style="box-sizing:border-box;margin-bottom:0px;margin-top:0px;">The item''s part number, (fetched data from shop)''Art.nr: 1240-300095006''. </li><li style="box-sizing:border-box;margin-bottom:0px;margin-top:0px;">The item''s description, ''Name: (fetched data from shop)Clutch set''. </li><li style="box-sizing:border-box;margin-bottom:0px;margin-top:0px;">The price, displayed in an editable field, (fetched data from shop)''2980,00''. </li><li style="box-sizing:border-box;margin-bottom:0px;margin-top:0px;">The quantity, with a dropdown to select the number of items, defaulting to (fetched data from shop)''1''. </li> </ul><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">Include an edit icon next to the quantity field to indicate that the price and quantity can be adjusted after import. </p><p style="box-sizing:border-box;margin-bottom:16px;margin-top:16px;">For the backend, ensure the functionality can handle data import from an external catalog and present it in a structured format within the application. The code should also enable the user to edit the fetched price and quantity, reflecting the changes in the overall cost calculations of the service order. </p><p style="box-sizing:border-box;margin-bottom:0px;margin-top:16px;">The design should focus on usability, ensuring that all elements are clear and straightforward for the user to interact with, and responsively fit within the application''s interface. </p></span></span><p style="box-sizing:border-box;"> </p> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/b723d508-59f5-4a84-ac73-83e94a62cc81?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><br> </div>',