ont-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17768','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-05 09:47:23.797+05:30','2024-06-05 09:47:23.797+05:30','2024-06-05 09:47:23.797+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|chathusarat@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
