	('azure_workitems','2024-07-30 12:28:17.048695+05:30','17769','As a QA, I want tot update the "Kursforespørsler til godkjenning" tile notification when user move to another unit','<div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Observation:</strong><span style="font-size:11pt;"> </span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">&quot;Kursforespørsler til godkjenning&quot; tile notification is not updating when user move to a another unit, when that user has pending approval </span> </div><div style="font-family:Calibri;font-size:11pt;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Steps:</strong> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">1. Regular User A from unit1 create a course and send for approval  </span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">2. Then User A, move to Unit2</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">3. Check the &quot;Kursforespørsler til godkjenning&quot; of admin in unit1</span> </div><div style="font-family:Calibri;font-size:11pt;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Actual Result</strong><span style="font-size:11pt;"> </span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;"> &quot;Kursforespørsler til godkjenning&quot; tile Notification count is still there. But there us no record  </span> </div><div style="font-family:Calibri;font-size:11pt;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Expected Result  : </strong> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">&quot;Kursforespørsler til godkjenning&quot; tile Notification count should be reduced </span> </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17769','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-05 09:52:59.503+05:30','2024-06-05 09:52:59.503+05:30','2024-06-05 09:52:59.503+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|chathusarat@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
