	('azure_workitems','2024-07-30 12:20:05.227858+05:30','17792','As a developer, I would like to encrypt the state report id when downloading the state report on OI','<div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3dc88559-5527-4dfc-90a4-0b6e8d0b8655?fileName=image.png" alt=Image><br> </div><div><br> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">This basically allows anyone to download any state report(pdf) from BUS Platform, without any security control on this API method.</span> </div><div><br style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;"><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">Since we can''t send a token from OI(client) for this (since we need to provide this feature to unauthenticated users), as what we do in P3 --&gt; Kompetanse, go with a special mechanism dedicated to this use scenario built on P3 Cryptography Aspect for cross-API encryption/decryption.</span> </div><div><br style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;"><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">&nbsp;&nbsp;&nbsp;&nbsp;Such a parameter stateReportId should be encrypted when it''s pumped out to OI, and we send the encrypted value to FileServer where it will be decrypted safely. Then, get the state report id.</span> </div><div><br style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;"><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">&nbsp;&nbsp;&nbsp;&nbsp;Regarding what state report ids can be sent to OI(client), that''s secured in another API where you guys generate them. E.g. no state report ids from a customer/unit which a user can''t access.</span><br> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/7c3fd573-ed9c-4e1c-b9dc-49f8f6632817?fileName=image.png" alt=Image><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/f8ee966c-a312-47c7-83ad-439afbe48329?fileName=image.png" alt=Image><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">Also regarding&nbsp;<span style="background-color:rgb(248, 248, 248);display:inline !important;">&quot;State report is considered active if it''s within 45 days&quot;, s</span><span style="background-color:rgb(248, 248, 248);display:inline !important;">eems we should only expose state reports inside a scope, instead of all we have.</span></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">And regarding the business requirement here (initially addressed on <a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/9788">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/9788</a>), there was a comment from Feng as below.</span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><span style="background-color:rgb(248, 248, 248);display:inline !important;">May also check with business people on a double time: whether this is really what they want to expose all state reports on our platform to the public world! Then, anyone can get any state report file!</span><br style="background-color:rgb(248, 248, 248);"><span style="background-color:rgb(248, 248, 248);display:inline !important;">This sounds so scary as I see, at least in my personal opinion! Such a business requirement might be deeply considered twice before they say &quot;Go!&quot;. Don''t build a software product based on brainstorms but deep thinking!</span><span style="height:8px;display:block;background-color:rgb(248, 248, 248);"></span><span style="background-color:rgb(248, 248, 248);display:inline !important;">Unless they do have a good reason and a particular why, this looks so scary! Give all state reports to anyone in this world, we even never did that on P2. A big data security matter?!</span><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><span style="background-color:rgb(248, 248, 248);display:inline !important;"><br></span></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><span style="background-color:rgb(248, 248, 248);display:inline !important;"><span style="background-color:rgb(248, 248, 248);display:inline !important;">Btw, do we show a customer''s logo on a state report? E.g. if a state report of Viking is shown to public, will that be good?</span><br></span></span> </div><div><br> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">Please do the needed follow up with <a href="#" data-vss-mention="version:2.0,3305a97a-c961-6eab-aa20-e2d5338efc25">@Simon Ahlberg</a>&nbsp;on this as well.</span><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17792','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-05 20:17:07.323+05:30','2024-06-25 11:38:48.667+05:30','2024-06-25 11:38:48.667+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-07T06:54:23.843Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-06-11T03:29:05.67Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Blocked_Dev"}, "changedAt": "2024-06-13T04:16:45.14Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-19T08:23:12.547Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-20T06:18:36.483Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-25T06:08:48.667Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','19216','01 Development',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19216','{"category": "Task"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-22 09:58:10.823+05:30','2024-07-22 10:01:28.88+05:30','2024-07-22 10:01:28.88+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T04:28:34.877Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-22T04:31:28.88Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18910','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','19217','02 Developer Testing + API Collection Update + Self Review',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19217','{"category": "Task"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-22 09:58:12.8+05:30','2024-07-22 09:58:12.8+05:30','2024-07-22 09:58:12.8+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18910','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:20:35.025586+05:30','17798','As a PO, I want to remove supplier from internal courses','<div><strike>Initial requirement: In P3, we load the suppliers from TrainingCoursesSupplier. But the existing courses are mapped to Supplier table. Hence, we need to display the old supplier name inside the course instance.&nbsp; </strike> </div><div><br> </div><div>For internal courses, supplier is not needed at all, so that we can remove that. </div><div><br> </div><div>(1) Inside courses view/edit we need to remove supplier for internal courses </div><div><br> </div><div>(2) Need to remove the supplier filter on internal courses grid </div><div><ul><li>No changes on all courses grid, and if a supplier is selected, only web courses would be filtered out </li> </ul><div>(3) We can keep the CourseSupplierID info in&nbsp;QualityEmployeeCourses&nbsp;table, but it won''t be used/shown at all. </div><div>We can delete the Supplier info on CoursePlan table, since these are added only for the new records and we don''t need to have it. </div> </div><blockquote style="margin:0 0 0 40px;border:none;"><div><div><ul><li>Note: D<span><span dir=ltr><span>idn''t perform this, since we handle this on application level when showing data, so that it would be simply ignored. However, this would be removed automatically when we delete this column when doing the DB clean up as part of <span class=richtext-autocomplete-highlight><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/17915" data-vss-mention="version:1.0">#17915</a>&nbsp;</span></span></span></span> </li> </ul> </div> </div></blockquote><div><div>(4) Not for this task, but can create a follow up task (for v2 may be) to remove the unwanted things related to this change from the DB </div> </div><blockquote style="margin:0 0 0 40px;border:none;"><ul><li>Note: Created spike: <a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/17915" data-vss-mention="version:1.0">#17915</a>&nbsp;to remove unwanted things related to the change from the database.&nbsp; </li> </ul></blockquote><div><div><br><br><br><b>Impact:&nbsp;</b><br>As the course supplier/provider field was removed from internal courses, areas in which internal course instance details are displayed (course view/ instance view), internal course/course-instance grids and grid operations like filtering, sorting will be impacted.<br><br>Note:&nbsp;<br>Sorting was implemented to function same as other sortings.&nbsp; </div> </div><div>&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17798','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-06 02:07:27.667+05:30','2024-06-09 19:09:15.49+05:30','2024-06-09 19:09:15.49+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-05T21:00:22.84Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-07T09:12:20.567Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-07T09:18:45.383Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-07T19:57:25.603Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-06-09T13:39:15.49Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','19218','03 Review',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19218','{"category": "Task"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-22 09:58:14.77+05:30','2024-07-22 09:58:14.77+05:30','2024-07-22 09:58:14.77+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18910','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:21:05.319055+05:30','17813','As a PO, I would like a change to Ecoonline in BUSkvalitet','<div><b><div style="box-sizing:border-box;"><span style="color:rgb(237, 92, 87);">UAT:</span> </div><div style="box-sizing:border-box;"><span style="color:rgb(237, 92, 87);">Nå skal man ikke lengre legge inn firmanavn, passord. Man skal kun velge EcoOnline så legge inn en link.&nbsp;</span> </div><div style="box-sizing:border-box;"><span style="color:rgb(237, 92, 87);">Om de ikke legger inn deres egen link, så kommer de som default til ecoonline.no</span> </div><br><br></b> </div><div><b><u>Background:</u></b> </div><div>Ecoonline has made changes in their link &amp; login </div><div><span>This requires a change in BUSkvalitet so the user lands on the correct page at ecoonline.</span><br> </div><div><br> </div><div><b><u>Requirement:</u></b> </div><div><ul><li>Replace the existing Username, Password, Firma (Firmakode, Brukernavn, Passord) fields with a link field </li><li>Default: have &quot;<a href="https://www.ecoonline.com/no/" target=_blank rel="noopener noreferrer">https://www.ecoonline.com/no/</a>&quot; in this field </li><li>Field is editable so that u<span>ser then will paste their link in this field</span> </li><li>Admin sets the link for all users (keep Ecoonline under Tabeller, but swap existing 3 fields with 1 link field </li><li>Behavior for user will be at they click <b><i>Min Side &gt; Stoffkartotek</i></b>, then it opens that link directly in a new browser tab. </li> </ul> </div><div><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);">Example of a link (Admin will paste in something similiar to this):&nbsp; </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><span lang=NO-BOK style="margin:0px;"><a href="https://app.ecoonline.com/+rdb212c6f6-f0fe-4179-a2cc-a233fbd774bc" style="margin:0px;color:rgb(70, 120, 134);text-decoration:underline;" target=_blank rel="noopener noreferrer">https://app.<span style="margin:0px;">ecoonline</span>.com/+rdb212c6f6-f0fe-4179-a2cc-a233fbd774bc</a></span> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><br> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><br> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);">Old way: </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><span lang=NO-BOK style="margin:0px;">&nbsp;</span> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><span lang=NO-BOK style="margin:0px;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/b23def80-06fe-44cf-b8e7-5558e5c96685?fileName=image.png" alt=Image><br></span> </p> </div><div><br> </div><div><br> </div><div>New way:&nbsp; </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3448cfb2-2053-4fdb-8e80-090a0d28d1e2?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Note:&nbsp; </div><div><ul><li>For the existing records, we can remove the user name password added there&nbsp; </li><li>DB Change is required <a href="#" data-vss-mention="version:2.0,19b8c663-a32b-607a-bcf6-adbbf400a94b">@Anders Aanje</a>&nbsp;<a href="#" data-vss-mention="version:2.0,e01c7883-70a2-612f-aa68-d77ac340e44d">@Ishara Kumararathna</a>&nbsp; </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17813','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-06 16:16:08.007+05:30','2024-06-27 16:54:51.61+05:30','2024-06-27 16:54:51.61+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-19T06:55:04.233Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-20T07:15:58.313Z"}, {"status": {"newValue": "Done", "oldValue": "In TQA"}, "changedAt": "2024-06-20T07:16:07.14Z"}, {"status": {"newValue": "In TQA", "oldValue": "Done"}, "changedAt": "2024-06-20T07:16:26.693Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-24T04:25:09.35Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-24T07:45:41.63Z"}, {"status": {"newValue": "In TQA", "oldValue": "Reopened"}, "changedAt": "2024-06-24T12:30:42.97Z"}, {"status": {"newValue": "Business QA", "oldValue": "In TQA"}, "changedAt": "2024-06-25T09:58:23.12Z"}, {"status": {"newValue": "UAT", "oldValue": "Business QA"}, "changedAt": "2024-06-27T11:24:29.44Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "changedAt": "2024-06-27T11:24:51.61Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|lauren@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
