	('azure_workitems','2024-07-30 12:27:05.586715+05:30','19223','01 Development',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19223','{"category": "Task"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-22 10:05:46.767+05:30','2024-07-22 11:35:40.91+05:30','2024-07-22 11:35:40.91+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T04:39:28.21Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-22T06:05:40.91Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|19222','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:04.816826+05:30','17814','As a PO, I would like to fix the flow for "add course to unit" for completed course instance created by normal user','<div><div> </div><h3 style="box-sizing:border-box;"><span style="color:rgb(237, 92, 87);">UAT:</span><br><span style="color:rgb(237, 92, 87);">Som vanlig bruker, lag et nytt kurs.</span> </h3><div><span style="color:rgb(237, 92, 87);"><b>Som admin, logg inn og gå på &quot;Kurs per ansatt&quot; og finn dette kurset, nå ved hjelp av ikonet og tooltip (tekst som forklarer ikonet). Du skal også kunne trykke på knappen &quot;legg til for avdelingen&quot;&nbsp;</b></span> </div><div><br> </div><h3 style="box-sizing:border-box;"><b style="box-sizing:border-box;">Agreed Solution&nbsp;</b><b style="font-size:14px;">-------</b> </h3><div style="box-sizing:border-box;font-size:14px;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);display:inline !important;">In &quot;Kurs per ansatt&quot; table, will display an indicator as below for the courses created by regular user.</span></span> </li><li style="box-sizing:border-box;"><span style="font-weight:400;box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);display:inline !important;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;background-color:rgb(248, 248, 248);display:inline !important;">Once course is added for the unit this indicator should be removed.</span></span></span> </li><li style="box-sizing:border-box;"><span style="font-weight:400;box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);display:inline !important;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;background-color:rgb(248, 248, 248);display:inline !important;">When user hover over indicator a tooltip should display.</span></span></span> </li><ul><li style="box-sizing:border-box;"><span style="font-weight:400;box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);display:inline !important;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;background-color:rgb(248, 248, 248);display:inline !important;">Tooltip text&nbsp;<span style="color:rgba(0, 0, 0, 0.9);font-size:14px;text-align:start;display:inline !important;">&quot;Create by [name]&quot;</span></span></span></span> </li><li style="box-sizing:border-box;"><span style="font-weight:400;box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);display:inline !important;"><span style="box-sizing:border-box;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;background-color:rgb(248, 248, 248);display:inline !important;">Tooltip feature only applicable for web. Will consider for mobile later.</span></span></span>&nbsp;<b><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/4c4e3a85-ecb8-4ea9-b85d-2f836cd37c4b?fileName=Screenshot%202024-06-26%20at%2010.27.58.png" alt="Screenshot 2024-06-26 at 10.27.58.png"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/1cca97d4-363b-42b1-9cc7-3b620284026a?fileName=Screenshot%202024-06-27%20at%2011.23.35.png" alt="Screenshot 2024-06-27 at 11.23.35.png"></b> </li> </ul> </ul> </div><div style="box-sizing:border-box;font-size:14px;"><div style="color:rgba(0, 0, 0, 0.9);display:inline-flex;"><div style="display:inline-flex;"><div style="height:7px;background-color:rgb(219, 98, 108);cursor:nw-resize;top:-3px;left:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:ne-resize;top:-3px;right:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:sw-resize;bottom:-3px;left:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:se-resize;bottom:-3px;right:-3px;"> </div><div style="border:1px solid rgb(219, 98, 108);pointer-events:none;"> </div> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:nw-resize;top:-3px;left:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:ne-resize;top:-3px;right:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:sw-resize;bottom:-3px;left:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:se-resize;bottom:-3px;right:-3px;"> </div> </div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;"><div style="font-weight:bold;box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);"> </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);"><ul style="box-sizing:border-box;padding:0px 0px 0px 20px;"><li style="box-sizing:border-box;">When inside a course instance,&nbsp; </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">display course &quot;create by&quot; label. Created by [User name] </li><li style="box-sizing:border-box;">display &quot;Add this course to unit&quot; button </li> </ul> </ul><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3fa83d1e-4d49-4562-af8e-2a16ed5ac4c9?fileName=completed.jpg" alt=completed.jpg style="font-weight:bold;"><br> </div></span> </div> </div><div><br> </div><div>------------------------------------------------------------------------------------- </div><h3>Initial requirement </h3><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);">We discussed this during pre-release testing but did not include in V1. Let''s discuss to be sure the logic is clear. Right now we have a gap where customer is expected to add a completed course to a unit, but we only have this functionality for future courses. </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><br> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><br> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);">1 Normal user creates a course, past date so status is &quot;fullført&quot; and then cannot edit after saving </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><span>2 Admin cannot see course under &quot;Alle kurs&quot; since it is a course instance and does not know about it since no approval required. Not clear that must go to &quot;Fullførte kurs&quot; or search in &quot;Kurs per ansatt&quot; to find it.&nbsp;</span> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><span>3 Once Admin finds it, Admin cannot see in any way that it is created by normal user. Cannot edit it.</span><br> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);"><br> </p><p style="margin:0cm;font-size:11pt;font-family:Aptos, sans-serif;color:rgb(36, 36, 36);">Expected result: Admin needs a better way to be notified that a user has created this course (needs help finding it) and needs to see clearly when opening it that it was created by the normal user. And needs option to add for the unit.&nbsp; </p><br> </div><div>2:&nbsp;<span>Admin can see there is a new completed course under &quot;Fullførte kurs&quot; but does not see any notification for &quot;Kurs per ansatt&quot;</span> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3f3a2d74-1d35-4ae3-a5b1-55aacfa43ab5?fileName=image.png" alt=Image><br> </div><div><br> </div><div>3. In the grid, Admin can see a new completed course, but does not see it was created by normal user. Expected result: Someone mark this course so Admin can see it was created by a user. </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/743926a5-8ed8-445c-bfd5-5e943e6c53a7?fileName=image.png" alt=Image><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/4af3ff42-5f8a-4646-a6d2-cb0f38c43ad7?fileName=image.png" alt=Image><br> </div><div><br> </div><div>4: Admin opens course and still does not see he can add this to unit. Expected result: Show here that it was created by normal user and have option to &quot;add to the unit&quot; </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/b23b6d3e-9ff1-4835-9c8f-21a03c9fb757?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Note:&nbsp; </div><div><ul><li>The change should reflected in both grid and course view<br> </li><li>Indicator should display until admin adds the course to the unit. Indicator no longer need after added to unit&nbsp; </li><li>Below details should show </li><ul><li>Who belongs to that course&nbsp; </li><li>Option to add the course to unit&nbsp; </li> </ul><li>Indicator should display in Completed course grid and employee courses grid </li><li>Mockup required <a href="#" data-vss-mention="version:2.0,43faa749-cabc-6512-9b03-50de06c22b9e">@Oshadi Wattuhewa</a>&nbsp; </li> </ul><div><div><b><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);font-weight:400;"><ul style="box-sizing:border-box;padding:0px 0px 0px 20px;"><li><br> </li> </ul> </div><br></b> </div><b></b> </div><div><b><br></b> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17814','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-06 18:16:32.803+05:30','2024-07-09 18:27:46.58+05:30','2024-07-09 18:27:46.58+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-26T03:57:46.68Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-05T04:34:29.627Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-08T05:21:42.19Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-09T06:26:14.557Z"}, {"status": {"newValue": "UAT", "oldValue": "Business QA"}, "changedAt": "2024-07-09T10:56:44.9Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "changedAt": "2024-07-09T12:57:46.58Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|lauren@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
