	('azure_workitems','2024-07-30 12:28:17.048695+05:30','17894','Show Oscar inspector on google','<div>As a user I want to find Oscar Inspector when searching on google. Today google doesn''t list <a href="http://www.oscarinspector.com">www.oscarinspector.com</a>&nbsp;(or any other sits like .no and .se) Expected behavior is that google show <a href="http://www.oscarinspector.com">www.oscarinspector.com</a>&nbsp;on top when searching for &quot;Oscar inspector&quot; CC:&nbsp;<a href="#" data-vss-mention="version:2.0,f44b5306-5f4f-6607-bee6-4f272f0862ec">@Lauren Høivik</a>&nbsp;<a href="#" data-vss-mention="version:2.0,7bf83639-1073-6e35-8898-6e0fe34e2608">@Samra Aman</a>&nbsp;<a href="#" data-vss-mention="version:2.0,3305a97a-c961-6eab-aa20-e2d5338efc25">@Simon Ahlberg</a>&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17894','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-07 13:40:29.887+05:30','2024-06-07 13:40:29.887+05:30','2024-06-07 13:40:29.887+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|henrik@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
