	('azure_workitems','2024-07-30 12:24:04.137967+05:30','17907','As a PO, I want to update sending of emails','<div><strike>We should detach sending of email from Unit''s email address. As default all emails should be sent from noreply@bus.no </strike> </div><div><strike><br> </strike> </div><div><strike>Units may override the address used for sending emails by adding SMTP-settings or have a separate address field.&nbsp; </strike> </div><div><strike><br> </strike> </div><div><strike>If they decide to override with the address directly they should have a notification that they need to authorize our email servers for sending from their domain.&nbsp; </strike> </div><div><strike><br></strike> </div><div>The changes that were made in this story is as follows,<br><br><ol><li>The Epost shown in the Admin -&gt; Firma page and on the SMTP popup were de-attached to 2 different email addresses. Refer the screenshot below.&nbsp;<br><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/60a527ce-9f61-46df-b868-1087b16b62a3?fileName=Screenshot%202024-07-04%20092629.png" alt=Image style="width:495px;height:304px;" width=495 height=304><br> </li><li>When the edit icon in the Firma page is clicked the user now can only add a Sender Email (Avsender Epost) instead of the Server Address and other fields. In that case, the emails will sent using the given email address instead of the default BUS email address. (Note that there are 2 checks that is been made when overriding the sender email and relevant messages will be shown) </li><ol style="list-style:lower-alpha;"><li>When no SPF-Record is found </li><li>When SPF-Record found but no reference to BUS servers&nbsp; </li> </ol> </ol>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Note that for testing purposes we can test using ''bus.no'' or ''anders.no'' domains to check if the default BUS email address is being overridden with the given ones. To specifically test the relevant messages being displayed in the above mentioned 2 scenarios we should contact Anders and get his help.&nbsp; </div><div>&nbsp; &nbsp; &nbsp; &nbsp; </div><div>&nbsp; &nbsp; &nbsp; &nbsp; 3<span>. When the user provides a server address and other SMTP settings and if the relevant domain allows overriding emails (Eg: gmail doesn''t allow overriding email addresses) then the email should be sent from the given address.&nbsp;</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17907','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-07 15:41:57.083+05:30','2024-07-11 16:50:14.587+05:30','2024-07-11 16:50:14.587+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-28T04:49:53.693Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-04T08:51:43.93Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-04T08:53:19.737Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-05T08:34:26.197Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Reopened"}, "changedAt": "2024-07-05T08:34:54.693Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-05T11:24:03.2Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-05T11:38:54.23Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-08T03:16:15.493Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-08T04:12:21.353Z"}, {"status": {"newValue": "Reopened", "oldValue": "Business QA"}, "changedAt": "2024-07-08T07:30:49.073Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Reopened"}, "changedAt": "2024-07-08T08:20:05.207Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "change