	('azure_workitems','2024-07-30 12:28:17.048695+05:30','17266','As a developer, I want to update OI pages for SEO','<div>Added content optimization requirements in the attachments of the story. The file is adapted to the blog. But similarly, we should investigate and improve other pages. This story will contain suggestions what could we do.&nbsp; </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/a9466a05-9afd-4936-baf5-cbe5b9e3e51b?fileName=image.png" alt=Image><br> </div><div><br> </div><div><ol><li>Update title and description tags: </li><ol style="list-style:lower-alpha;"><li>Value for new title&nbsp; -&nbsp;<span style="display:inline !important;"><span style="color:rgb(237, 92, 87);">&nbsp;</span></span><span style="display:inline !important;color:rgb(200, 38, 19);">[value]</span> </li><li>Value for new description -<span style="color:rgb(200, 38, 19);"> [value]</span> </li> </ol><li><span style="color:rgb(0, 0, 0);">Update logo icon</span> </li><li><span style="color:rgb(0, 0, 0);">In legal pages, switch from div with class to headers. We use div because of the styling, but maybe we could still use headers and overwrite the style.</span> </li><li><span style="color:rgb(0, 0, 0);">Review all header texts in landing, about Oscar and other pages. </span><span style="color:rgb(200, 38, 19);">Can something be updated to be more engaging?</span> </li><li><span style="color:rgb(0, 0, 0);">Review image alt tags and write better descriptions.</span> </li><li><span style="color:rgb(0, 0, 0);">Review images and compress additionally. Our images are already compressed, but there could be individual images that could be compressed more.</span> </li><li><span style="color:rgb(0, 0, 0);">Consider using other image formats, like webp (if supported by all browsers)</span> </li><li><span style="color:rgb(0, 0, 0);">Add site map. This needs more investigation if it will work with hash router, which we use in OI app.</span> </li><li><span style="color:rgb(0, 0, 0);">Use breadcrumbs throughout the whole site?</span> </li><li><span style="color:rgb(0, 0, 0);">Investigate schema markups and where we could add it to the pages. Check which <a href="https://developers.google.com/search/docs/appearance/structured-data/search-gallery">types of schema markups</a> we could use in different places in OI.</span> </li><li>Cleanup unused images and files. </li><li>&quot;The page cannot be cached because it has a BroadcastChannel instance with registered listeners.&quot; investigate this warning from Lighthouse. </li><li>Add accessible names to all buttons, links and menu items. </li> </ol> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17266','{"category": "Feature"}',NULL,'{"category": "In Progress"}',NULL,NULL,'2024-05-24 13:25:39.17+05:30','2024-05-31 12:29:34.647+05:30','2024-05-31 12:29:34.647+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-30T11:34:48.557Z"}, {"status": {"newValue": "In Progress", "oldValue": "Development In Progress"}, "changedAt": "2024-05-31T06:59:34.647Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|4430','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
