	('azure_workitems','2024-07-30 12:16:12.137433+05:30','16387','As a developer, I need to update the Refresh_Token to allow to refresh for a new token to access messaging portal','<div>In Token_RefreshToken(…), take an extension to allow to refresh for a new token to access messaging portal. </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/2c284120-2a29-465d-9b77-af6854fa8c3e?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Notice the application for messaging portal has already been created in the enum before.<br> </div><div><br> </div><div>&nbsp;For messaging portal, the used SignUpSignInPolicyId should be B2C_1A_BUSPLATFORM3-B2C_SIGNUP_SIGNIN_ROPC_UPDATEREFRESHTOKEN.<br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16387','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-02 11:39:29.75+05:30','2024-05-20 20:45:10.76+05:30','2024-05-20 20:45:10.76+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-06T07:52:50.95Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-06T12:33:44.373Z"}, {"status": {"newValue": "Blocked_QA", "oldValue": "In TQA"}, "changedAt": "2024-05-07T03:34:56.797Z"}, {"status": {"newValue": "In TQA", "oldValue": "Blocked_QA"}, "changedAt": "2024-05-16T01:37:19.32Z"}, {"status": {"newValue": "Done", "oldValue": "In TQA"}, "changedAt": "2024-05-16T07:23:52.733Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "Done"}, "changedAt": "2024-05-16T07:32:25.763Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-20T15:15:10.76Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|10708','Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|168','Azure-Workitems|SAMPLE-AS-Norway'),
