	('azure_workitems','2024-07-30 12:21:35.408558+05:30','16441','As a user, I need to see course instances that are in ''not scheduled'' state to show in My courses grid','<div>Admin/Normal user should be able to see ''not planned'' state course instances in My courses grid. </div><div><br> </div><div>We need to show courses required for the user and not scheduled ones.&nbsp; </div><div><br> </div><div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><b>Comment from developer </b><br>There are a few things to mention:<br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">1) Showing both scheduled and not-scheduled courses in a single list could cause a performance issue. Due to this,&nbsp;<span style="box-sizing:border-box;">It''s better to separate the scheduled and non-scheduled courses using tabs.</span> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">2) Question: What happens if a user clicks on a non-scheduled record?<br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">Options:&nbsp;<br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">* Direct the user to the main course view in read-only mode.<br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">Options(Admin)<br style="box-sizing:border-box;"> </div><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">* Admin is able to schedule the course for himself using a popup similar to the All Employee Course Assignments grid.</span><br> </div><div><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><br></span> </div><div><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">Note:&nbsp;</span> </div><div><ul><li><span style="color:rgba(0, 0, 0, 0.9);">Realtime update is not required here&nbsp;</span> </li> </ul><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16441','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-02 15:39:42.523+05:30','2024-06-28 16:53:04.727+05:30','2024-06-28 16:53:04.727+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T08:33:37.583Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-26T10:49:24.22Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-26T14:09:05.07Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-27T10:00:43.52Z"}, {"status": {"newValue": "In TQA", "oldValue": "Reopened"}, "changedAt": "2024-06-27T10:15:26.48Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-27T10:16:12.38Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-27T10:20:21.593Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-06-28T11:23:04.727Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|PoornimaS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
