	('azure_workitems','2024-07-30 12:27:41.714046+05:30','16442','As a user, I need to see a consistency in order of filters and grid columns','<div><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">Order of the&nbsp;</span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">Obligatorisk kurs and Status filters are different compared to how their respective columns are showing in the grid.</span> </div><div><br style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);"><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">In filter section<span>&nbsp;</span></span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">Obligatorisk kurs filter is showing after&nbsp;</span><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">the Status filter but in grid&nbsp;</span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);">Obligatorisk kurs column is showing before Status column.</span><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">&nbsp;</span> </div><div><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;"><br></span> </div><div><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/55cd5ca7-69cf-4910-bc99-67687d610e02?fileName=6c558772-7b29-4dc2-9166-643476676ea4.png" alt=6c558772-7b29-4dc2-9166-643476676ea4.png><br></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16442','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-02 15:49:59.54+05:30','2024-05-02 15:49:59.54+05:30','2024-05-02 15:49:59.54+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|PoornimaS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:16:42.141899+05:30','16499','As a developer, I would like to update Orange SMTP settings everywhere','<div><font color="#1d1c1d" face="Slack-Lato, Slack-Fractions, appleLogo, sans-serif"><span style="font-size:15px;"><span style="font-size:14px;display:inline !important;">New SMTP Server IP :<span>&nbsp;</span></span><b style="box-sizing:border-box;font-size:14px;">bus-p1-mail1.p2.osl.basefarm.net</b><br></span></font><ol style="margin:0px;list-style-type:none;counter-reset:list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;"><li style="margin-bottom:0px;margin-left:28px;"><br> </li><li style="margin-bottom:0px;margin-left:28px;">1. update codes always on the 1st place. </li><li style="margin-bottom:0px;margin-left:28px;"><br> </li><li style="margin-bottom:0px;margin-left:28px;">2. update the deployed instances. </li><li style="margin-bottom:0px;margin-left:28px;"><br> </li><li style="margin-bottom:0px;margin-left:28px;">3. when updating codes, 2 conditions: P2 &amp; P3. </li> </ol><div style="counter-reset:list-0 0 list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;P2: directly on those web.config files, straightforward;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;P3: we decoupled emailing out of the main trunk on P3. So, no any P3 API is related to the email server directly. Instead, in P3 Utilities, we have an email utility. Go to that 1 unique project on P3 and update its config files. </div><div style="counter-reset:list-0 0 list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;"><br>&nbsp;&nbsp;4. when updating deployed instances:<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;[1]. use 1 instance on dev &amp; test respectively for testing; all right, move ahead;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;[2]. P2, just on Orange servers, straightforward;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;[3]. P3, deployed on Azure Func App, go to that place to update the email server. (Today''s hybrid connection shall support it if no structure change on Orange server side; otherwise, may update hybrid connection between Azure func app &amp; orange servers). </div><div style="counter-reset:list-0 0 list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0;color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;"><br><span style="height:8px;display:block;"></span>&nbsp;&nbsp;&nbsp;5. And the end, may check those P2 independently running service, in case any of them uses emailing. </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16499','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-03 13:45:27.27+05:30','2024-05-21 14:01:25.66+05:30','2024-05-21 14:01:25.66+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-17T05:38:12.273Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-20T09:54:32.963Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-20T11:29:17.64Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-21T08:31:25.66Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|168','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:21:05.319055+05:30','18059','As a developer, I want to move news solution from v2 to v1.3','<div>We have made a new blog/news solution, but it was meant for v2. Now we want to move it to v1.3. </div><div><br> </div><div>Related stories in v2: </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/13926" data-vss-mention="version:1.0">#13926</a>&nbsp; </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/16094" data-vss-mention="version:1.0">#16094</a>&nbsp; </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/16095" data-vss-mention="version:1.0">#16095</a>&nbsp; </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/17450" data-vss-mention="version:1.0">#17450</a>&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18059','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-11 15:33:11.73+05:30','2024-06-26 19:38:55.207+05:30','2024-06-26 19:38:55.207+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-12T06:48:52.03Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-17T12:54:25.057Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-06-19T11:32:46.66Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-19T11:36:10.267Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-26T14:08:55.207Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','16511','As a PO I want to add new  supplier ','<div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Improvement: Normal user or Admin user.... create course and supplier is not there. Need to add supplier.</span><br> </div><div> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Normal user needs an &quot;Add supplier&quot; option here:</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/f7be0f23-7004-4c71-b602-e15369afcdeb?fileName=image.png" alt=Image style="width:472px;height:258px;" width=472 height=258><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Admin needs an &quot;Add supplier&quot; button here:</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/497e1d81-eee3-4ca5-b522-8d07978c96e4?fileName=image.png" alt=Image style="width:428px;height:234px;" width=428 height=234><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><h3><font face=Calibri><span style="font-size:14.6667px;"><b>Suggested solutions :&nbsp;</b></span></font> </h3><div><font face=Calibri><ul style="font-size:14.6667px;"><li><font face=Calibri><span>Here we can use kendo combo box :&nbsp;</span></font><a href="https://www.telerik.com/kendo-react-ui/components/dropdowns/combobox/">https://www.telerik.com/kendo-react-ui/components/dropdowns/combobox/</a> </li><li><span style="font-size:14px;">Normal User or Admin could add a value that is missing for supplier field using above combo box.</span><br> </li><li><span style="font-size:14px;">Supplier name should validate against existing supplier names (as we do in P2 today). So we avoid duplicates.</span> </li><li><span style="font-size:14px;">Normal User cannot delete supplier. Can only add.<br></span> </li><li><span style="font-size:14px;">If wants to delete a newly added supplier Admin has to got to&nbsp;<b>BK --&gt; Tabeller--&gt; Leverandører</b> and do it.<br></span> </li><li><span style="font-size:14px;">When a supplier is added by normal user, it should be available for public use immediately.<br></span> </li> </ul><div style=""><br> </div><div style=""><br> </div></font> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16511','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-03 18:02:20.64+05:30','2024-05-03 18:02:20.64+05:30','2024-05-03 18:02:20.64+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NadeeshaG@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway');
