	('azure_workitems','2024-07-30 12:21:35.408558+05:30','16553','As a QA, i want to fix not displaying all My courses regardless of which unit the course was created in','<div><span style="color:rgb(237, 92, 87);"><b>UAT:</b></span><b><br></b><span style="color:rgb(237, 92, 87);"><b>Test dette med en bruker du flytter fra Unit A til Unit B. Brukeren må ha noen kurs i Unit A før du flytter. Etter du flytter brukeren, sjekk at disse kursene vises under &quot;min side &gt; mine kurs&quot;</b></span> </div><div><b><br></b> </div><div><b>Observation:</b><br> </div><div> </div><div> </div><div>The courses created in other unit are not displayed in My courses grid and My completed courses grid. </div><div><br> </div><div>Unit 1 -&gt; My courses </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/d5a926ac-5996-47e1-b721-edaa8255aa7c?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Unit 2 -&gt; My courses </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/287d8fe3-a63d-4a64-b038-ace23b18b2c1?fileName=image.png" alt=Image><br> </div><br><b>Steps:</b><div>Move one employee from one unit to another unit<div><div style="font-weight:400;box-sizing:border-box;">Login to the new unit&nbsp; </div>Click on My courses tile and validate courses<br><br><b>Expected Result:</b><br><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">Shows all courses regardless of which unit the course was created in.</span> </div><div><strike><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">However: only transfer courses from Unit A to Unit B if they are:</span> </strike> </div><div><ul><li><strike><span style="color:rgba(0, 0, 0, 0.9);display:inline !important;">Unit A-created courses that are completed (do not transfer Unit A created courses that are not complete)</span> </strike> </li><li><font color="rgba(0, 0, 0, 0.9)"><span style="color:rgb(0, 0, 0);"><strike>Web courses of status: fullført, planlagt, deltatt?</strike></span></font> </li> </ul> </div><div><font color="rgba(0, 0, 0, 0.9)"><br></font><b>Actual Result:</b> </div><div>Only the courses created in the selected unit are displayed in the My courses grid </div><div><br> </div><div>Note:&nbsp; </div><div><ul><li>Apply the needed security control to support this scenario: User should be able to open the course created in other units ONLY if the user is assigned to that course </li> </ul><br><b>System Info(OS/Browser Version,Device):</b><br><br><b>Test Data:</b><br><br><b>Impact (to be filled out by developer)</b><br> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16553','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-06 14:32:31.987+05:30','2024-07-09 14:02:22.62+05:30','2024-07-09 14:02:22.62+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-19T08:29:34.573Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-24T10:46:41.52Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-24T11:26:43.31Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-25T16:52:29.96Z"}, {"status": {"newValue": "In TQA", "oldValue": "Reopened"}, "changedAt": "2024-06-27T07:24:09.417Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-27T07:29:34.937Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-27T11:25:40.053Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-04T10:47:57.443Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-04T11:02:07.743Z"}, {"status": {"newValue": "Blocked_QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-08T02:55:34.23Z"}, {"status": {"newValue": "Reopened", "oldValue": "Blocked_QA"}, "changedAt": "2024-07-08T04:17:52.147Z"}, {"status": {"newValue": "In TQA", "oldValue": "Reopened"}, "changedAt": "2024-07-08T04:18:35.477Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-08T04:54:02.82Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-08T09:29:56.517Z"}, {"status": {"newValue": "UAT", "oldValue": "Business QA"}, "changedAt": "2024-07-09T07:20:43.763Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "changedAt": "2024-07-09T08:32:22.62Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|15268','Azure-Workitems|SAMPLE-AS-Norway|chathusarat@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:15:12.03332+05:30','16570','As a developer, I want home page search field text changes for SWE version','<div>Change from:&nbsp;Registreringsnummer -&gt;&nbsp;Ange regnummer<br>Change from:&nbsp;Mästarställning -&gt;&nbsp;Ange miltal </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16570','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-06 20:01:37.55+05:30','2024-05-07 12:00:09.677+05:30','2024-05-07 12:00:09.677+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-06T14:31:57.017Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-06T14:41:30.737Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-07T01:21:11.47Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-07T02:50:55.18Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-07T06:30:09.677Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ignas.dapkunas@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|168','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:04.816826+05:30','18108','As a developer, I want to send encrypted state report id','<div>Once backend changes are done, we need to update client side code to send encrypted state report ids. </div><div><br> </div><div>This is done to make the endpoint more secure, as explained in detail in the predecessor story. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18108','{"category": "User Story"}',NULL,'{"category": "Blocked_QA"}',NULL,NULL,'2024-06-13 14:42:50.357+05:30','2024-06-27 09:49:32.653+05:30','2024-06-27 09:49:32.653+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-19T11:57:15.2Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-26T06:48:35.87Z"}, {"status": {"newValue": "Blocked_QA", "oldValue": "In TQA"}, "changedAt": "2024-06-27T04:19:32.653Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:21:05.319055+05:30','18199','As a PO I want to show prices on requisitions ordered by Drive','<div>When drive orders&nbsp;requisitions in BUS we dont show any prices.&nbsp; </div><div>If we dont get any prices from Drive we use the price from the valuation (same as we do for Carweb).&nbsp; </div><div><br> </div><div>cc <a href="#" data-vss-mention="version:2.0,7bf83639-1073-6e35-8898-6e0fe34e2608">@Samra Aman</a>&nbsp;<a href="#" data-vss-mention="version:2.0,f44b5306-5f4f-6607-bee6-4f272f0862ec">@Lauren Høivik</a> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18199','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-17 17:16:20.743+05:30','2024-06-20 13:39:34.347+05:30','2024-06-20 13:39:34.347+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T03:53:36.417Z"}, {"status": {"newValue": "Done", "oldValue": "Development In Progress"}, "changedAt": "2024-06-20T08:09:34.347Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|vidar@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
