	('azure_workitems','2024-07-30 12:17:14.025288+05:30','16782','As a PO i want to change links "re-direction" on some active links on our pages ( NO and SWE page) ','<div>We want to change some links on our pages on OI this is relevant for both SWE and NO page.&nbsp;<br><br>For detailed info see attachment PP&nbsp;<br><br>OBS once you do the Linkedin-link please confirm that provided link directs you to the relevant linkedin-page ( as a double confirmation).&nbsp; </div><div>Note regarding Linkedin - the URL is separately updated in the Login page for the Pay flow. So it needs to be tested there separately. </div><div><br> </div><div>Note regarding legal pages:&nbsp;<span>The links should be automatically fixed with story </span><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/16785" data-vss-mention="version:1.0">#16785</a><span>&nbsp;</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16782','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-14 13:08:21.497+05:30','2024-05-27 19:31:56.107+05:30','2024-05-27 19:31:56.107+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-17T09:02:41.593Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-05-17T11:57:14.293Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-05-20T07:25:26.87Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-20T12:04:35.74Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-21T05:41:26.31Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Reopened"}, "changedAt": "2024-05-21T07:25:49.707Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-05-22T14:24:41.853Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-05-27T06:43:55.75Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-27T06:47:06.38Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-27T10:03:38.877Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-27T14:01:56.107Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:21:05.319055+05:30','18200','As a user, I would like column "Underområde" added to Export of Deviation grid ("avvik")','<div>Strategic customer groupings require more detail in the deviation grid export. </div><div><br> </div><div>Need to add &quot;underområde&quot; to the export to Excel. </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/c3a9e056-7758-49b1-823f-c97b86b8899e?fileName=image.png" alt=Image style="width:757px;height:528px;" width=757 height=528><br> </div><div>If the deviation has multiple selections for &quot;underområde&quot; then list each one as a separate row. </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/cf088d8f-4f92-4b72-8fdc-605d5b707dff?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br>For example, Deviation &quot;Test&quot; has area &quot;HMS&quot; selected and subarea &quot;Vedlikehold&quot; and &quot;Brann eksplosjon&quot; so there will be two rows for this deviation. </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/ce462fe7-8f94-4cf2-be81-1af63a7fa185?fileName=image.png" alt=Image><br> </div><div><br> </div><div>If there are multiple areas (område) and sub-areas (underområde) then one row for each. In this case, 5 rows: </div><div>HMS &gt; Vedlikehold </div><div>HMS &gt; Brann eksplosjon </div><div>Verksted &gt; Reklamasjon </div><div>Kundeklage &gt; Faktura klage </div><div>Kundeklage &gt; Service klage </div><div><br> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/e22139ec-411d-4af2-8078-dbd5ae98c702?fileName=image.png" alt=Image><br> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/40d70f24-8aac-4018-81cf-7370783ba726?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Notes:&nbsp; </div><div><ul><li>we should differentiate rows added for different Areas/sub areas in a different colour&nbsp; </li><ul><li>Except the Areas and Sub areas we can leave blank for rest of the columns </li> </ul><li><br> </li> </ul> </div><div><div style="box-sizing:border-box;"><br><br> </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18200','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-17 17:16:50.737+05:30','2024-07-02 17:16:35.513+05:30','2024-07-02 17:16:35.513+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T08:49:57.257Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-25T12:03:50.28Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-06-25T12:31:23.83Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-26T03:12:21.793Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-26T06:34:18.15Z"}, {"status": {"newValue": "In TQA", "oldValue": "Business QA"}, "changedAt": "2024-06-26T06:39:11.677Z"}, {"status": {"newValue": "Reopened", "oldValue": "In TQA"}, "changedAt": "2024-06-26T06:51:00.983Z"}, {"status": {"newValue": "In TQA", "oldValue": "Reopened"}, "changedAt": "2024-06-27T06:52:58.727Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-27T09:33:17.533Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-27T09:49:14.973Z"}, {"status": {"newValue": "UAT", "oldValue": "Business QA"}, "changedAt": "2024-06-28T10:44:15.22Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "changedAt": "2024-07-02T11:46:35.513Z"}]','Azure-Workitems',NULL