	('azure_workitems','2024-07-30 12:16:42.141899+05:30','16783','As a PO i want to change the order of tabs on NO-FAQ. ','We want to change the order of the tag on the NO- FAQ page.&nbsp;<br><div><br>For detailed info please check added attachment PP&nbsp;<br><br> </div><div>&quot;<div style="margin-top:0pt;margin-bottom:0pt;margin-left:.38in;text-indent:-.38in;text-align:left;unicode-bidi:embed;"><span style="font-size:15.0pt;"><span style="">1.</span></span><span style="font-size:15.0pt;font-family:Aptos;color:#0D0D0D;">Move</span><span style="font-size:15.0pt;font-family:Aptos;color:#0D0D0D;"></span><span style="font-size:15.0pt;font-family:Aptos;color:#0D0D0D;">the</span><span style="font-size:15.0pt;font-family:Aptos;color:#0D0D0D;">&nbsp;&quot;Profil&quot;
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:27:41.714046+05:30','16811','As a user, I would like dropdown selection and grid filter selections to be dynamic','<div>Standarize and simplify dropdowns and results lists </div><div><br> </div><div>Dropdowns: </div><div>User can type a letter and the results will be dynamically filtered </div><div><br> </div><div>Grid: </div><div>User selects a dropdown menu item and instead of clicking &quot;Filter&quot; the grid results are dynamically updated. </div><div><br> </div><div>In both cases, if user removes letters, the grid is again updated. </div><div><br> </div><div>Dropdown example: </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/c54a4cba-47a9-4a2a-a359-d5d522f94ef9?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16811','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-14 15:46:01.423+05:30','2024-05-14 15:46:01.423+05:30','2024-05-14 15:46:01.423+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|lauren@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:32.566251+05:30','18237','As a developer, I want to enable zoom','<div>In the index file, we set the maximum scale to 1, because if we don''t, there is an issue with iPhones automatically zooming in on focusing input. However, this is considered as a bad practice, because it prevents mobile users from pinch zooming. So we should investigate if there are other ways to fix the iPhone zoom, without forcing maximum scale.&nbsp; </div><div>This requires an iPhone for testing. </div><div><br> </div><div>&lt;meta name=&quot;viewport&quot; content=&quot;width=device-width, initial-scale=1, <b>maximum-scale=1</b>&quot;&gt;<br> </div><div><br> </div><div>More info about the best practices: </div><div><a href="https://webhint.io/docs/user-guide/hints/hint-meta-viewport">https://webhint.io/docs/user-guide/hints/hint-meta-viewport</a><br> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18237','{"category": "User Story"}',NULL,'{"category": "Business QA"}',NULL,NULL,'2024-06-18 13:31:34.1+05:30','2024-07-02 16:44:11.44+05:30','2024-07-02 16:44:11.44+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-26T07:01:13.71Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-28T09:32:20.733Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-02T04:09:40.113Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-02T11:14:11.44Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:16:42.141899+05:30','16825','As an Admin, I want to link related items for web course','<div>Admin should able to link related items for web courses.&nbsp;<br> </div><div>Open a web course --&gt; Click edit --&gt; Add related items<br><br>Related items can be linked only in course level, <b>cannot link in course instance level.&nbsp;</b> </div><div><b><br></b> </div><div><b>Note&nbsp; :&nbsp;</b> </div><div><ul><li><b>Admin only can add the related items only for the course . Not for the course instances.&nbsp;</b> </li><li><b>even for the admin also cannnot add the items from course instance levels</b> </li> </ul> </div><div><b><br></b> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16825','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-14 17:44:58.167+05:30','2024-05-22 17:18:50.373+05:30','2024-05-22 17:18:50.373+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-16T03:58:27.077Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-17T04:18:39.09Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-17T05:57:18.533Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-21T06:04:59.573Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-22T03:01:07.587Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-22T04:42:14.113Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-22T11:48:50.373Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|OshadiW@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:16:12.137433+05:30','16848','As a developer, I would like to reflect the email/sms setting changes done on daily notifications on real time email/sms as well','<div>We have done several email/sms settings changes (<span style="">SMS sender name, Email sender name and SMTP settings) on daily notifications together with the email template changes we did as part of </span><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/15863" data-vss-mention="version:1.0" style="">#15863</a><span style="">&nbsp;.</span> </div><div><br> </div><div>Until we come up with a email template for real time notifications, we need to apply the other changes for daily notifications as well. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16848','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-15 10:24:33.067+05:30','2024-05-16 17:30:41.377+05:30','2024-05-16 17:30:41.377+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-15T04:59:15.85Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-15T09:25:04.073Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-15T11:33:18.74Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-16T11:22:46.79Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-16T12:00:41.377Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18238','As a developer, I want to improve null handling in FileResult','<div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/a5830a78-cae4-43f9-a3bc-0b699777293e?fileName=image.png" alt=Image><br>we cannot&nbsp;<span><span dir=ltr>return null from an action method with a return type of Microsoft.AspNetCore.Mvc.FileResult. So this should be updated as below.<br><br><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/2c3f40fb-ba4a-412c-92b7-c9ab6363ef6e?fileName=image.png" alt=Image><br></span></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18238','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-18 14:48:15.893+05:30','2024-06-18 14:48:15.893+05:30','2024-06-18 14:48:15.893+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:04.816826+05:30','18367','As an Architect, I want to configure security portal to get a token for File Server ','<div><ul><li>It should possible to get an access token and a refresh token from security portal&nbsp; </li><li>These token should work in file server Rest API&nbsp; </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18367','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-20 13:43:54.39+05:30','2024-07-08 10:41:40.91+05:30','2024-07-08 10:41:40.91+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T08:14:05.107Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-24T13:33:39.337Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-06-25T06:10:46.58Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-27T04:15:36.637Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-08T05:11:40.91Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:30:53.449807+05:30','19256','As a developer, I need to fix on how we do the comparison on dates on the DB on documents by removing the DbFunctions.TruncateTime',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19256','{"category": "Bug"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-22 14:41:39.807+05:30','2024-07-22 14:41:39.807+05:30','2024-07-22 14:41:39.807+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','16916','As  a PO , Admin would like a quick way of opening expire courses','<div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"> In the case of a course that expires and needs to be taken again, Admin would like a quick way of opening that course (link to open that course - not as in V1 with link to search for a course) and a &quot;repeat&quot; icon next to participant name who has completed that course.&nbsp;</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">This way Admin can click the &quot;repeat&quot; icon and add a new date for that participant to attend the course again.&nbsp;</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Why?&nbsp;</span> </div><div><ul><li><span style="font-family:Calibri;font-size:14.6667px;">Some courses like safety and PKK are repeated every year or 5 years and this would make the process less manual for Admin</span> </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16916','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-16 10:25:13.767+05:30','2024-05-16 10:25:13.767+05:30','2024-05-16 10:25:13.767+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NadeeshaG@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','16943','As a PO, I want only active procedures/documentation to be displayed in the drop downs','<div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">What is showing in &quot;procedure&quot; and &quot;documentation&quot; dropdowns? I have a unit with zero approved procedures and documentation, so when I select a category, it is empty. But when I make no category selection, leaving it at &quot;Velg&quot; and then click in procedure dropdown, there are many. Where do these come from? They are not approved active procedures for my unit</span><br> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Notes :&nbsp;</span> </div><div><font face=Calibri><span style="font-size:14.6667px;">Above is the same logic in P2</span></font> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16943','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-16 13:27:48.24+05:30','2024-05-16 13:27:48.24+05:30','2024-05-16 13:27:48.24+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|SamraA@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:32.566251+05:30','18414','As an Architect, I want to write integrate File Server API in P2 Application ','<ul><li>Integrate file server rest API to P2 Application&nbsp; </li><li>Register a service provider file for Rest API file server in P2 application. Just like we did for other Rest API integration&nbsp; </li><li>Refer BUSdataService on how to obtain a token from Security portal </li> </ul>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18414','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-24 12:21:32.46+05:30','2024-07-03 14:30:13.21+05:30','2024-07-03 14:30:13.21+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-24T09:46:27.367Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-26T13:35:26.283Z"}, {"status": {"newValue": "Done", "oldValue": "Review"}, "changedAt": "2024-07-03T09:00:13.21Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway');
