	('azure_workitems','2024-07-30 12:30:53.449807+05:30','19287','[Multiple Emails] As a QA, I want to fix receiving multiple emails when assign a task for a user who has an invalid phone number',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19287','{"category": "Bug"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-24 17:34:03.38+05:30','2024-07-24 17:34:03.38+05:30','2024-07-24 17:34:03.38+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|chathusarat@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:16:42.141899+05:30','16945','As a PO I want to do some changes in the Toast message ','<div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Toast message covers up buttons. Should we move it? Or is there a reason to have it there? Seems it could be moved up a bit so it doesn''t cover the buttons</span><br> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/ef7e6902-282f-4142-ba53-b6dabaa7cbb6?fileName=image.png" alt=Image><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><u>Note :</u></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;"><span style="font-family:Calibri;display:inline !important;">ove up so toast message is in the blank space above the buttons, not covering the buttons. Will want it like this for all future modules too.</span><br></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16945','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-16 13:47:15.673+05:30','2024-05-21 16:18:10.653+05:30','2024-05-21 16:18:10.653+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-17T03:38:56.93Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-17T11:06:03.717Z"}, {"status": {"newValue": "Business QA", "oldValue": "In TQA"}, "changedAt": "2024-05-20T17:08:04.077Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-21T10:48:10.653Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NadeeshaG@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|168','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','16949','As  a QA I want to have this functions in the context menu and the Bulk in all employee course grid','<div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">Identified few changes in All employee''s course assignment grid record context menus and bulk mark as completed compared to Kompetanse user permission sheet</span> </div><div style="font-family:Calibri;font-size:11pt;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Steps</strong> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">1. Go to All employee''s course assignment grid</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">2. Check context menu for a Planned course instance</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">3. Check context menu for a Overdue course instance</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">4. Check context menu for a Pending approval course instance</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">5. Check context menu for a Not scheduled course instance</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">6. Check the bulk operations in the grid</span> </div><div style="font-family:Calibri;font-size:11pt;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Expected result: </strong><span style="font-size:11pt;">Following options should be there,</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">2 - Mark as completed</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">3 - Mark as completed</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">4 - Approve, Reject</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">5 - Delete</span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="font-size:11pt;">6 - Bulk Mark as completed option in the grid</span> </div><div style="font-family:Calibri;font-size:11pt;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><strong style="font-size:11pt;">Actual result: </strong><span style="font-size:11pt;">Above options are missing in context menu and bulk Mark as completed button is also missing in the grid</span> </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16949','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-16 13:56:50.2+05:30','2024-05-16 13:56:50.2+05:30','2024-05-16 13:56:50.2+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NadeeshaG@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:16:42.141899+05:30','16975','As a developer, I want to fix some UI alignments','<div><ol><li><span>Remove space between text and &quot;:&quot; after vehicle search in gauge,&nbsp;</span> </li><li><span>Fix flag &quot;white&quot; borders (The flag is apparently a bit smaller than it''s container)</span> </li><li><span><span style="display:inline !important;"><span style="display:inline !important;">Fix menu element in pay page flow 2nd screen SWE, so the height is consistent</span><br></span></span> </li><li><span><span style="display:inline !important;">Inputting mileage/registration number makes it so the input element changes width based on error width, fix it so that the width is always consistent</span></span><span></span> </li> </ol> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16975','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-16 15:30:39.013+05:30','2024-05-28 12:12:52.96+05:30','2024-05-28 12:12:52.96+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-16T10:01:38.207Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-05-16T12:35:28.873Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-05-17T07:30:48.817Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-17T08:25:18.607Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-20T11:11:18.14Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-28T06:42:52.96Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ignas.dapkunas@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:32.566251+05:30','18415','As a PO, I want to use azure cloud storage for inspection images in P2','<div><ul><li>Use the file server provider to handle inspection images&nbsp; </li><li>New image should upload to below blob file path: </li><ul><li><span>General Images - BUSpek/GeneralImages/{x}/</span> </li><li><span>Defect Images - BUSpek/DefectImages/{x}/<br></span><br> </li> </ul><li>File server provider handled in this story: &nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/18414" data-vss-mention="version:1.0">#18414</a>&nbsp; </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18415','{"category": "User Story"}',NULL,'{"category": "TQA In Progress"}',NULL,NULL,'2024-06-24 12:25:26.01+05:30','2024-07-30 09:54:19.43+05:30','2024-07-30 09:54:19.43+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-27T09:54:30.72Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-17T04:24:42.977Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-26T05:17:29.8Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-29T12:56:40.74Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-30T04:19:44.813Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-30T04:24:19.43Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17167','As a developer, I want a new API to fetch active state report in BUS Test for OI','<div>This has been already implemented in BUSDataPortal.(<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/9788" target=_blank rel="noopener noreferrer" style="box-sizing:border-box;font-size:14.6667px;">User Story 9788</a><span style="box-sizing:border-box;font-size:11pt;">: As a developer, I want a new API to fetch active state report</span>). We need to relocate this particular changes in the BUSTest. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17167','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-21 10:41:59.69+05:30','2024-05-21 10:41:59.69+05:30','2024-05-21 10:41:59.69+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:17:14.025288+05:30','17186','As a developer, I want to have an overlay for the help info popup to be displayed more clearly visible',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17186','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-21 13:10:55.833+05:30','2024-05-23 12:31:07.133+05:30','2024-05-23 12:31:07.133+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-21T07:41:00.497Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-21T11:42:11.37Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-22T07:33:59.13Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-22T07:42:18.407Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-23T07:01:07.133Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|HarshanaE@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17187','As a PO I want to prevent deleting courses if one or more participants have completed it','<div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">Unit A to Unit B. User completes a course in Unit A.&nbsp;</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;text-align:left;display:inline !important;">User is moved to Unit B, so that course follows.&nbsp;</span><span style="font-family:Calibri;font-size:14.6667px;">Then the Admin in Unit A deletes the course. The course is removed from the user who now is in Unit B.&nbsp;</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;"><br></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;">Wondering if we should prevent deleting courses if 1 or more participants have completed it.</span> </div><div><span style="font-family:Calibri;font-size:14.6667px;"><b><u><br></u></b></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;"><b><u>Note :&nbsp;</u></b></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;"><b><br></b></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;"><b><span style="font-family:Calibri;font-weight:400;text-align:left;display:inline !important;">Corner scenario. Rare case that an Admin will delete a course when participants have completed it. Consider though for V2 either A) disable delete for courses if one or more users have a completed course instance of B) in the case of course with one or more completed course instances, Admin can archive the course (will not see it active, but will move to &quot;Historic&quot; tab in All courses for example)</span><br></b></span> </div><div><span style="font-family:Calibri;font-size:14.6667px;"><br></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17187','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-21 14:22:43.593+05:30','2024-05-21 14:22:43.593+05:30','2024-05-21 14:22:43.593+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NadeeshaG@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:37.29432+05:30','18435','As a PO, I want to read files from file storage for BUSpekLink','<ul><li>Files are getting uploaded to Azure blob storage as part of this story: <a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/18415" data-vss-mention="version:1.0">#18415</a>&nbsp; </li><li>Now we need to read the uploaded images from Azure blob storage when display it in BUSpekLink </li> </ul>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18435','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-24 16:36:33.07+05:30','2024-07-23 17:35:02.79+05:30','2024-07-23 17:35:02.79+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-01T12:13:52.213Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-18T03:54:31.37Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-19T02:36:36.323Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-22T10:46:49.05Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-23T12:05:02.79Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway');
