	('azure_workitems','2024-07-30 12:18:02.438642+05:30','17188','As a developer, I need to change the OI contact us URLs along with the new OI URL','<div> </div><span>Update the contact us URLs(BUSDataPortal API) accordingly<br><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/65a3299b-698b-47cc-bcd3-b64d63d5f9c8?fileName=image.png" alt=Image><br><br>New URLs<br><br>https://dev.oscarinspector.com/<br></span><div>https://test.oscarinspector.com<br> </div><span>https://oscarinspector.com</span>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17188','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-21 14:58:14.06+05:30','2024-05-28 12:09:35.037+05:30','2024-05-28 12:09:35.037+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-22T06:54:24.323Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-22T13:15:14.247Z"}, {"status": {"newValue": "Business QA", "oldValue": "In TQA"}, "changedAt": "2024-05-22T13:33:01.213Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-28T06:39:35.037Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:21:35.408558+05:30','17189','As a PO, I would like an orange counter on the Min Side >Kompetanse menu ','<div>In P2 and in current P3 implementation, user does not see a counter on the Kompetanse menu, like user sees for Tasks, Equipment and other things. Confusing for the user, since they do not know there is something they need to do there.&nbsp; </div><div><br> </div><div>Add counter that summarizes the counters on the Kompetanse dashboard. </div><div><br> </div><div>Example: On Kompetanse dashboard there are 28 on &quot;Mine forfalte kurs&quot; and 1 on &quot;Påminnelser...&quot; then the Left side menu &quot;Kompetanse&quot; will have a an orange indicator. </div><div><br> </div><div>Note:&nbsp; </div><div><ul><li>Consider only the numbered notification in grid for the indication&nbsp; </li> </ul> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/6377badf-3ec4-47f0-8552-f784035ffa86?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17189','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-21 14:58:49.623+05:30','2024-07-08 18:48:02.987+05:30','2024-07-08 18:48:02.987+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-19T06:27:16.51Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-06-19T06:55:22.483Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T07:17:42.19Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-04T07:19:17.66Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-04T09:07:33.01Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-05T10:05:22.797Z"}, {"status": {"newValue": "