	('azure_workitems','2024-07-30 12:25:36.879408+05:30','18436','As a PO, I want to read files from file storage for BUStestlink','<ul><li>Files are getting uploaded to Azure blob storage as part of this story: <a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/18415" data-vss-mention="version:1.0">#18415</a>&nbsp; </li><li>Now we need to read the uploaded images from Azure blob storage when display it in BUStestLink </li> </ul>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18436','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-24 16:46:55.25+05:30','2024-07-26 09:17:41.543+05:30','2024-07-26 09:17:41.543+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-01T12:44:47.943Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-17T04:27:01.003Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-18T04:40:27.36Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-19T12:38:35.42Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-22T06:24:49.44Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-23T04:04:54.207Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-25T11:04:18.97Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-07-26T03:47:41.543Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17257','As a PO, I want to change the strategy for how we present the results of BUSdata/OI API.','<p style="margin:0px 0px 0px 21px;text-indent:-21px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 21px;"><span style="">Once the result presented with detailed defect list we currently use the strategy Show: “a maximum of 15 errors” and probability down to 1%.</span><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px;"><br><span style="">This has resulted in several feedback &quot;Is there 15 errors on all cars?”&nbsp;<br></span><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px;">Therefore, we want to change the strategy for which results should be displayed.&nbsp; </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Requirements:</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Remove the maximum limit on the number of errors. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>&nbsp;Only u</span>se a percentage probability to guide the results. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>The lower limit should be down to 1.5%. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br>This shall be applied for bot &quot;OI-page&quot; and in &quot;BUStest/API&quot;&nbsp;<br><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Priority</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">High priority. </p><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17257','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-22 17:51:29.467+05:30','2024-05-22 17:51:29.467+05:30','2024-05-22 17:51:29.467+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	(NULL,'2024-07-30 12:28:17.048695+05:30','13834',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:22:32.566251+05:30','18440','As a PO, I want to Authenticate BUS users with Autopix','<div>There are couple of steps when authenticating users with Autopix </div><div><br> </div><div>Autopix account details </div><div> </div><span>User: client1@test.no<br></span><span>Password: client1pass</span><div><br> </div><div><br> </div><div>First we need a ClientId and a ClientSecret from Autopix. This is different for each environment and below are the staging env details </div><div><br> </div><div><span>Staging OAuth credentials for &quot;BUS AS&quot;:<br></span><div>client_name: BUS AS<br> </div><div>client_id: 6<br> </div><span>client_secret: ojZz2m4xXewjiN0OFFqDBrGSgzK0nDx2I4s3A19O</span> </div><div><span style=""><br></span> </div><div><span style="">Phase 1:</span><br> </div><div><span><div>The client redirects the user to a special route on the authorization server with a<br> </div><div>certain set of parameters. this special route is /oauth/authorize and the required parameters<br> </div><div>are as follows:<br> </div><div>client_id - This will be provided by the authorization server.<br> </div><div>redirect_url - This is a route on the client, usually /callback or /auth/callback but can be anything else.<br> </div><div>response_type - The type of code expected by the client. In the first phase, the values should be &quot;code&quot;.<br> </div><div>Example request: https://wispy-hurricane-sgvgd1jaof7x.vapor-farm-c1.com/oauth/authorize?client_id=5&amp;redirect_url=https://your-callback-url-here.com/&amp;response_type=code<br> </div><div><br> </div><div>After redirection, if the user is already authorized inside Autopix, the user will be asked to give permission to the &quot;BUS&quot;<br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/f9bff140-19c9-48d9-9f2e-d206d9e2c09a?fileName=image.png" alt=Image><br> </div><div><br> </div><div>After the user gives permission to the BUS AS, the second phase starts where you will convert the code to the actual token.<br> </div><div><br> </div><div>Phase 2:&nbsp; </div><div>The second phase begins with the extraction of the authorization code from the<br> </div><div>query parameter. The client then has to make a second request to another special route on<br> </div><div>the authorization server. This time the request has to be a POST request and contain another set of parameters in the<br> </div><div>request body. this second special route is /oauth/token and the required parameters are as<br> </div><div>follows:<br> </div><div>client_id and redirect_url will be the same as was in the previous request.<br> </div><div>client_secret - This will be provided by Autopix just like the ID.<br> </div><div>grant_type - Indicates the type of grant which in this case is authorization_code.<br> </div><div>code - The code received from the server as a result of the previous request.<br> </div><div><br> </div><div>curl --location ''https://wispy-hurricane-sgvgd1jaof7x.vapor-farm-c1.com/oauth/token'' \<br> </div><div>--form ''grant_type=&quot;authorization_code&quot;'' \<br> </div><div>--form ''client_id=&quot;6&quot;'' \<br> </div><div>--form ''client_secret=&quot;ojZz2m4xXewjiN0OFFqDBrGSgzK0nDx2I4s3A19O&quot;'' \<br> </div><div>--form ''code=&quot;&quot;''<br> </div><div><br> </div><div>you will receive access and a refresh token as a response<br> </div><div><br> </div><div>{<br> </div><div>&quot;token_type&quot;: &quot;Bearer&quot;,<br> </div><div>&quot;expires_in&quot;: 31536000,<br> </div><div>&quot;access_token&quot;: &quot;eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiJ9..hc7CCsQjoO1jqcE8KfCPdhEZ7ZvGstZPUi3Mi7GmlyyWY1ahi6AOll_rJ2LzfvPnyQ8ZFU4mAJBAIU88C_iujenvSyhjc4Uv9j1gIfPrv43m94Rf6jYa6J64S64qrh8VuVTZHPGw0CNKcA_JWLKlrBYeB_7pngsGzwfQXL5s18EEcyGPEiF5g2YgYkLj5Bz78E0Key95qs7tDaPzESAXXRWfrzL3wFAMCYnB99UP-bxTA2N0j2VAcPguOTSihhjK0GqUVooMd6sBroLomJ2oWEtJju6xgWDdxLyFugGPZ2YUMRvpeGkyu0sI7WOqJ6SRO5U9YL_M1I1AndF38APPXVA3cfhIkYzI8YlVFrPKiZJCxu4aeEOnUThtig5XMeHHB3gyW1hhZ6mcz14PEM0X-eH6D9N1WwgSAO1P5iWmXsTwd2TipGhkEdHcVGphonNNBKFnwNqYym42SD_quJnxYbor0bOBv9QJa60UsbD5ywmGg5mddp_swbA-l99F3SL2dVQvO9ogRRGtrY9qcTsGJgi4S2U7M9SfOvQVSowB55E2FE0Wi5mUA7bQuTFxedLtSBEsE8g1w0g47FUbWlthekfdAybsi1da7UzBdyu9naMnQ6zGSbJ_E-RARyEj-P6Pse1a-WfV_F3jhZ4bScCv1dJ4enAtTN0WpK4dZBUXJ0k&quot;,<br> </div><div>&quot;refresh_token&quot;: &quot;&quot;<br> </div><div>}<br> </div><div><br> </div><div><br> </div><div>to refresh an expired token you will make a request to /oauth/token with the POST method and<br> </div><div>following form body<br> </div><div>{<br> </div><div>grant_type: refresh_token,<br> </div><div>refresh_token: the_refresh_token,<br> </div><div>client_id: client_id,<br> </div><div>client_secret: client_secre<br> </div><div>}<br> </div><div>Put the previous refresh_token, client_id, client_secret and you will get another response<br> </div><div>containing other tokens.<br> </div><span></span><br></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18440','{"category": "User Story"}',NULL,'{"category": "Blocked_Dev"}',NULL,NULL,'2024-06-25 11:30:10.073+05:30','2024-07-03 16:07:43.987+05:30','2024-07-03 16:07:43.987+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-25T06:03:34.467Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-07-03T10:37:43.987Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|13834','Azure-Workitems|SAMPLE-AS-Norway|DhinethraW@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:17:14.025288+05:30','17190','As a user, I would like to use different title for the Kursnavn in External Course Portals','<div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">In this popup &quot;Kursnavn&quot; should be just &quot;Navn.&quot;. No other places should be affected.</span><br> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/624c967c-915c-4c9b-acf3-7379d1102972?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17190','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-21 15:23:47.517+05:30','2024-05-22 15:51:53.217+05:30','2024-05-22 15:51:53.217+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-21T09:58:25.67Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-22T03:53:31.13Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-22T07:15:46.617Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-22T07:33:47.64Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-22T10:21:53.217Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:19:06.744902+05:30','17255','AS a PO I want to investigate and implement more alternative for Login on OI-page. ','<div style="margin:0px 0px 0px 21px;text-indent:-21px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 21px;"><span>	</span><span style="font-family:&quot;Times New Roman&quot;;text-indent:0px;display:inline !important;">Based on feedback from customers and the upcoming costs from Vipps, we want to provide customers with more options and simplify their use of our service.</span> </div><div style="margin:0px 0px 0px 21px;text-indent:-21px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 21px;"><span style="text-indent:0px;">We wish to investigate and get back a time estimate for what it would entail to add more login options to the OI page (both NO and SWE).</span><br> </div><div style="margin:0px 0px 0px 21px;text-indent:-21px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 21px;"><br> </div><div style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><span style="font-family:&quot;Times New Roman&quot;;display:inline !important;">Look in to the diffrent possible alternatives aviable on existing P3 security/ login portal.<br></span><br>We want to have at least &quot;log in via Google-account&quot; &quot;log in via Facebook&quot; and if possible Apple.&nbsp;<br>But let´s investigate the alternatives possible.&nbsp;<br><br> </div><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Requirements:</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Identify possible login options available via the P3 platform. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Determine the costs associated with using some of these options (at least Google and Facebook). </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Select which options to use. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Create an updated UI based on this.= Mockup needed.&nbsp; </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Investigate If and what that would be affected by this: For example:&nbsp;<span style="font-family:&quot;.SF NS&quot;;display:inline !important;">how “my account” is affected for SWE and NO.</span>&nbsp; Does it affect anything with our Payment? ( We shall not change any payment method here!.&nbsp; </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Backend implications? </p><div style="text-indent:-13px;line-height:normal;font-size-adjust:none;margin:0px 0px 0px 13px;"><span style="text-indent:0px;"><ul><li style="color:rgb(14, 14, 14);font-family:&quot;.SF NS&quot;;font-size:14px;font-style:normal;font-weight:normal;">Even if the user doesn''t have the account created, they should be able to login using different login (i.e. Facebook, google, Apple login).&nbsp; </li><li style="color:rgb(14, 14, 14);font-family:&quot;.SF NS&quot;;font-size:14px;font-style:normal;font-weight:normal;">If user login using Facebook or Google, </li><ul style="color:rgb(14, 14, 14);font-family:&quot;.SF NS&quot;;font-size:14px;font-style:normal;font-weight:normal;"><li>If the mobile number is available in social login provider, read it from there </li><li>Else, provide an&nbsp;option to enter the mobile number in consent page&nbsp; </li> </ul><li><font color="#0e0e0e" face=".SF NS"><span>In consent page,</span></font> </li><ul><li><font color="#0e0e0e" face=".SF NS"><span>For Swedish, we say it use Email address and phone number and they agree with our terms and condition&nbsp;</span></font> </li><li><font color="#0e0e0e" face=".SF NS"><span>For Norwegian, check with PO later <a href="#" data-vss-mention="version:2.0,489e2f87-0bb8-6efe-a722-97d2eab83d58">@Henrik Jaeck</a>&nbsp;</span></font> </li><li><font color="#0e0e0e"><span><a href="#" data-vss-mention="version:2.0,43faa749-cabc-6512-9b03-50de06c22b9e">@Oshadi Wattuhewa</a>&nbsp;need mockup&nbsp;</span></font> </li> </ul> </ul><div><font color="#0e0e0e"><span style=""><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3fb31beb-98aa-4969-8518-0509b6d16e48?fileName=image.png" alt=Image><br></span></font> </div></span><br> </div><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Priority</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">This is of high priority. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">Vipps will introduce high costs for the login service via Vipps in August. Therefore, we want to quickly obtain a time estimate and start development to try to have this ready by August 1st (the business goal is August, if possible). Let´s do a good investigation of the things needed to achieve this.&nbsp; </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">Note:&nbsp; </p><p style="line-height:normal;font-size-adjust:none;margin:0px;"> </p><ul><li><br> </li> </ul><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17255','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-22 17:31:16.143+05:30','2024-06-10 20:08:44.6+05:30','2024-06-10 20:08:44.6+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-31T08:46:28.403Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-06-03T08:18:38.12Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-05T11:13:46.217Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-06-10T14:38:44.6Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:20:05.227858+05:30','17256','AS a PO I want to enable visitors on OI to see a “preview” / sample report.','<p style="margin:0px 0px 0px 21px;text-indent:-21px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 21px;"><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px;">Feedback from customers indicates that they would prefer a clearer view of a &quot;example&quot;/sample report. The existing section with the “computer screen illustrating the report” on &quot;Home&quot; and on &quot;Overallprediction&quot; is not clear enough for users. </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px;">Based on this feedback we would like to find a new design for that section and make it possible for the visitor to enlarge a &quot;pre-view&quot; of a report as an example.&nbsp;&nbsp;<br><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Requirements:</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Redesign of section 2 on the “home” page and also the section within “overallprediction” where the existing one is visible. </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Mockups needed for: <a href="#" data-vss-mention="version:2.0,43faa749-cabc-6512-9b03-50de06c22b9e">@Oshadi Wattuhewa</a>&nbsp; </p><p style="margin:0px 0px 0px 33px;text-indent:-33px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 33px;"><span>	</span>•<span>	</span>Design of the sample report - how it looks when you have clicked &quot;pre-view&quot;<span style="font-family:&quot;.SF NS&quot;;display:inline !important;"><span>&nbsp;</span>( Consider the design to be responsive)&nbsp;</span> </p><p style="margin:0px 0px 0px 33px;text-indent:-33px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 33px;"><span>	</span>•<span>	</span>Design of “section 2 home and overallprediction” where existing &quot;screen&quot; is shown.&nbsp; ( Consider the design to be responsive)&nbsp; </p><p style="margin:0px 0px 0px 33px;text-indent:-33px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 33px;"><span>	</span>•<span>	</span>Any other UI elements that need to be reviewed? </p><p style="margin:0px 0px 0px 33px;text-indent:-33px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 33px;">-&nbsp; <a href="#" data-vss-mention="version:2.0,3305a97a-c961-6eab-aa20-e2d5338efc25">@Simon Ahlberg</a>&nbsp;needs to think if some elements need to be interactive, like expanding the defect info. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Priority</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">Aim for August, or depending on the time it takes if faster please do. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">“Need/nice to have” </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><br><br> </p><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17256','{"category": "User Story"}',NULL,'{"category": "Business QA"}',NULL,NULL,'2024-05-22 17:39:50.85+05:30','2024-07-04 08:20:39.853+05:30','2024-07-04 08:20:39.853+05:30','[{"status": {"newValue": "Blocked_Dev", "oldValue": "New"}, "changedAt": "2024-05-31T06:57:44.61Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Blocked_Dev"}, "changedAt": "2024-06-07T06:40:50.117Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-12T07:18:21.653Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-06-12T07:59:25.973Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-13T09:18:13.907Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-14T04:11:42.093Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Reopened"}, "changedAt": "2024-06-17T05:00:44.783Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-17T06:04:07.053Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-06-17T06:40:41.05Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-17T08:21:06.167Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-17T08:51:21.323Z"}, {"status": {"newValue": "Reopened", "oldValue": "Business QA"}, "changedAt": "2024-07-01T13:27:38.37Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Reopened"}, "changedAt": "2024-07-03T05:39:40.513Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-03T09:57:26.02Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-03T10:24:44.497Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-03T11:24:14.407Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-04T02:50:39.853Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18503','As an admin, I would like to create a work order for a vehicle','<div><span style="display:inline !important;">Should be able to create new work order by starting with reg no.</span><br> </div><div><span style="display:inline !important;"><br></span> </div><div> </div><div>Should be able to </div><div><ul><li>Book a work order (verbally or via test link) </li><li>Send for a work order (via test link) -&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18905">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18905</a> </li> </ul><div>When confirmed verbally, the user should be able to mark it''s confirmed verbally. </div><div><br> </div><div>Flow to create a work order </div><div><ul><li>Set the times for work orders </li><li>Confirm the times from suppliers by providing work order details </li><li style="box-sizing:border-box;">Supplier can accept or say no </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">If a supplier says no, need to find another supplier, or reschedule it </li><li style="box-sizing:border-box;">Certain other follow up work orders may need to updated as well </li> </ul><li>Send the actual TestLink work orders to the confirmed suppliers </li><ul><li><span>There could be a cases where the supplier would not confirm as work order is done beforehand, but they would update it directly on BUStest later.&nbsp;</span><br> </li><ul><li><span>This happens when things happens internally, so that it would be communicated internally</span> </li> </ul> </ul> </ul><div><div>Notifications </div><div><ul><li>When approved/denied by the supplier, user should be notified on the app </li><ul><li>Real time updates needed? Yes, we should use Gql subscriptions for this </li><li>Any prompts like baloons? Would be considered later </li> </ul><li>Email/SMS? Not required </li> </ul> </div> </div> </div><div>Statuses </div><div><ul><li>Waiting for confirmation </li><li>Time confirmed </li><li>etc. Vidar will add the statuses </li> </ul> </div> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/725f6aa7-889b-4431-b70a-8df3225ab4ce?fileName=image.png" alt=Image><br> </div><div><br> </div><div><ul><li><span>Separate edit icon could be removed, and would be inside the context menu</span><br> </li><li>Bulk operations are available for the top grid </li><ul><li>Can assign work orders </li><li>Dropdown has the actions can be performed<br> </li> </ul><li>Below grid has the items which are not going to perform </li><li>Checkboxes can be removed from the below grid, since no bulk operations are available for them </li> </ul><div><div style="box-sizing:border-box;">Standard jobs would be available to pick. </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">These are defined inside unit settings (<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18890">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18890</a>) </li><li style="box-sizing:border-box;">These ones are available on the below grid here, and when picked, it comes to the top grid </li><li style="box-sizing:border-box;"><span>Also for any jobs not within the standard jobs, the user should be able to create one from the scratch (<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18504">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18504</a>)</span><br> </li> </ul> </div> </div><div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">Mockups to be finalized </div><br> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18503','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-26 14:36:24.863+05:30','2024-06-26 14:36:24.863+05:30','2024-06-26 14:36:24.863+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18372','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18504','As a user, I would like to create a new work order item','<div><span style="display:inline !important;">If an item cannot be found in standard jobs, user should be able to create a new one from the <span style="text-align:left;display:inline !important;">scratch<span>&nbsp;</span></span></span> </div><div> </div><span style="display:inline !important;"><div><span style="display:inline !important;"><br></span> </div>Mockups to be finalized</span>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18504','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-26 15:14:26.013+05:30','2024-06-26 15:14:26.013+05:30','2024-06-26 15:14:26.013+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18372','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18372','Work order - requisition','<div>Work orders can be created without having a valuation (a fresh work order) </div><div><br> </div><div>Work orders may be completed at different times. </div><div><br> </div><div>For now we send work orders in an email with a PDF. </div><div>We need to have the feature for the users to interact with a UI and mark the progress. </div><div><br> </div><div>Should be able to maintain the order of the work items. </div><div><br> </div><div>Should be able to pick a date when a work order can be completed. </div><div><br> </div><div>Should be able to notify when a work order is completed and when ready to move into the next item. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18372','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-20 14:46:35.5+05:30','2024-06-20 14:46:35.5+05:30','2024-06-20 14:46:35.5+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|vidar@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:18:02.438642+05:30','17258','AS a PO I want to Remove "duplicates" defects in BUSdata  and update the data. ','<p style="margin:0px 0px 0px 21px;text-indent:-21px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 21px;"><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><span>We have observed that there are errors presented that has &quot;the same&quot; fundamental issue presented but presented as 2 or more different defects.&nbsp; &nbsp;<br></span>It is&nbsp;<span style="font-family:&quot;.SF NS&quot;;display:inline !important;">duplicates of the same defect presented with different words, this leads to&nbsp;</span><span style="font-family:&quot;.SF NS&quot;;">redundancy.</span> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><br> </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);margin:0px;">We see this primarily on defects like:&nbsp; Rims &amp; Tires, Brakes, and Lighting. </p><p style="margin:0px;font:14px &quot;Times New Roman&quot;;color:rgb(14, 14, 14);min-height:16px;margin:0px;min-height:16px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Requirements:</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>We need an new export in&nbsp; Excel with the list of all defect&nbsp; including all relevant data to that ( incl &quot;description-text&quot;)&nbsp;&nbsp; </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Business will assist with &quot;mapping togheter&quot; &quot;same&quot; defects.&nbsp; </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>•</span><span>&nbsp;</span><span>Business will also make some changes to &quot;description text&quot; on defects.&nbsp;</span> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>•</span><span>&nbsp;</span><span>From this we need to update DB&nbsp;</span> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span><br><a href="#" data-vss-mention="version:2.0,882eaab5-a486-659f-817b-faed3b5f34d7">@Nethmal Warusamana</a>&nbsp;will provide the current list to <a href="#" data-vss-mention="version:2.0,3305a97a-c961-6eab-aa20-e2d5338efc25">@Simon Ahlberg</a>&nbsp;</span> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Priority</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">High priority. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><span>	</span>•<span>	</span>Request an estimate and act immediately. </p><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17258','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-22 18:05:47.13+05:30','2024-05-29 09:10:11.287+05:30','2024-05-29 09:10:11.287+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-29T01:23:25.62Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-05-29T03:40:11.287Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18505','As a user, I would like to create a TestLink for the supplier','<div>Supplier should be able to </div><div><ul><li>Confirm the time </li><li>Mark the progress of the work order </li> </ul><div>We need to include all the information on the valuation related to that particular defect. </div><div><ul><li>Including images </li><li>Excluding prices </li> </ul> </div><div>Also the comments should be included. </div><div><br> </div><div>If the status is already updated on BUStest (via TestLink before, or by BUStest directly), there should be a message for the supplier notifying it''s not a valid link anymore. </div><div><br> </div><div>When assigning multiple work orders to the same supplier, we should either </div><div><ul><li>Open them on same TestLink or </li><li>Open the multiple TestLinks on the same email </li> </ul> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18505','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-26 15:19:32.607+05:30','2024-06-26 15:19:32.607+05:30','2024-06-26 15:19:32.607+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18372','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18506','As an admin, I should be able to see the logs for vehicle','<div><span style="display:inline !important;">We need to consider the logs related to the chain of actions (valuations, work orders, state reports) for a particular vehicle.</span><br> </div><div><span style="display:inline !important;"><br></span> </div><div><span style="display:inline !important;">Should be a shared component we can use anywhere to refer logs.</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18506','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-26 15:21:19.44+05:30','2024-06-26 15:21:19.44+05:30','2024-06-26 15:21:19.44+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19065','As a developer, I need to increase the SQL Server version to 2019 (update compatibility level to 150) on Dev, Test & Prod environments','<div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/bb165cec-1518-479d-900b-edbdf18bf329?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19065','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-15 14:34:28.407+05:30','2024-07-16 13:12:20.92+05:30','2024-07-16 13:12:20.92+05:30','[{"status": {"newValue": "Done", "oldValue": "New"}, "changedAt": "2024-07-16T07:42:20.92Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|180','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18531','Shared components',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18531','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-27 09:04:56.53+05:30','2024-06-27 09:04:56.53+05:30','2024-06-27 09:04:56.53+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17264','AS a PO i want to investigate if it´s possible to map a image to a defect.','<p style="margin:0px 0px 0px 30px;text-indent:-30px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 30px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">We would like to explore the possibility of connect a image to a specific defect.&nbsp;<br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">In the long term, we wish to make it possible within OI to display an “example image” for a remark/defect point alongside the descriptive text. This aims to make it easier for the user receiving an Oscar report, e.g., an image of leaking brake lines or brake discs with more than 25% rust. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">To achieve this, we need to investigate if you could help us provide some pictures that has been added on a specific defect during PKK or &quot;Test&quot; on a car.&nbsp; Then we let the&nbsp; having the business side assist in selecting “the best image per defect point” and linking them accordingly.<br><br>How can we do this?&nbsp; </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">Once we have the ability to do this, and mapping is done we will create the remaining stories related to this to implement the results on the OI-page (UI, etc.).<br><br><br>This will mainly be for the OI-page but might be intreresting for some API-users. </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><a href="#" data-vss-mention="version:2.0,882eaab5-a486-659f-817b-faed3b5f34d7">@Nethmal Warusamana</a>&nbsp;will coordinate with Anders </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Requirements:</b> </p><div style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br><span style="font-family:&quot;.SF NS&quot;;text-indent:-13px;display:inline !important;">•</span><span style="box-sizing:border-box;font-family:&quot;.SF NS&quot;;text-indent:-13px;"><span>&nbsp;</span></span><span style="font-family:&quot;.SF NS&quot;;text-indent:-13px;display:inline !important;">Request an estimate and act immediately.</span><br> </div><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><br> </p><p style="margin:0px 0px 0px 13px;text-indent:-13px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px 0px 0px 13px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:15px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;"><b>Priority</b> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);min-height:17px;margin:0px;min-height:17px;"><br> </p><p style="margin:0px;font:14px &quot;.SF NS&quot;;color:rgb(14, 14, 14);margin:0px;">&nbsp;High priority. </p><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17264','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-22 18:29:03.947+05:30','2024-05-22 18:29:03.947+05:30','2024-05-22 18:29:03.947+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:27:41.714046+05:30','17322','As a developer, I want breadcrumbs to adhere to google SEO standards','<div>Research and apply proper breadcrumb usage to improve site indexing and SEO, especially for blog posts (or only for blog posts, discuss with Simon)<br><br>More details:&nbsp;<a href="https://developers.google.com/search/docs/appearance/structured-data/breadcrumb">https://developers.google.com/search/docs/appearance/structured-data/breadcrumb</a> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17322','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-27 13:26:06.37+05:30','2024-05-27 13:26:06.37+05:30','2024-05-27 13:26:06.37+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ignas.dapkunas@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18507','As an admin, I should be able to see the comments for vehicle','<div>We need to consider the comments related to the chain of actions (valuations, work orders, state reports) for a particular vehicle. </div><div><br> </div><div><span style="display:inline !important;">Should be a shared component we can use anywhere to refer comments.</span><br> </div><div><span style="display:inline !important;"><br></span> </div><div><span style="display:inline !important;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/f8ac2123-9bda-4865-b1d3-8b0b3a5b9a37?fileName=image.png" alt=Image><br></span> </div><div><span style="display:inline !important;"><br></span> </div><div><span style="display:inline !important;">Note: Date/time should also be there for each comment</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18507','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-26 15:21:35.867+05:30','2024-06-26 15:21:35.867+05:30','2024-06-26 15:21:35.867+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18518','As a user, I would like to create new valuation, work order, state report','<div>We should support creating new item inside valuations, work orders as it''s now. </div><div>Eg 1: Should be able to create a work order inside a valuation </div><div>Eg 2: Should be able to create a state report inside a work order </div><div>etc. </div><div><br> </div><div>Also when trying to start creating from a registration number, we should prompt the previously created valuations, work orders, state reports and allow the user to create new one based on those previous ones. </div><div> </div><div><ul><li>With a time limit (Eg: within 2months) </li><li>Any other criteria? </li> </ul> </div><div>Can we pick multiple items here? </div><div>Eg: One valuation + one work order when creating a state report </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18518','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-27 08:15:46.807+05:30','2024-06-27 08:15:46.807+05:30','2024-06-27 08:15:46.807+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18125','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18125','BUStest Application','<div><span>App suite is not a must for BUStest v1, so we embed anything needed on the BUStest application itself.</span><br> </div><div><span><br></span> </div><div><span>Policy based security on client side can be implemented to control the access for different components.<br></span> </div><div><span>However initially we should focus on the functionality and later security could be integrated.</span> </div><div><span><br></span> </div><div><span>Overall flow - to be considered for the mockups and stories</span> </div><div>Include the complete picture here? </div><div><span><br></span> </div><div><span><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/2eb95d9d-b815-477d-9673-ffff61eb4911?fileName=image.png" alt=Image><br></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18125','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-14 08:56:16.633+05:30','2024-06-14 08:56:16.633+05:30','2024-06-14 08:56:16.633+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:18:02.438642+05:30','17323','As a PO, I want to improve API methods for Drive','<div>Drive has reported an issue that they unable to fetch valuation/state report by VIN number for certain vehicle. When investigating the issue, it was noted that for vehicle without a registration number, valuator tend to add VIN number as the RegNumber. So when Drive call our API, they set VIN = VIN (entered as RegNumber). Ideally, here it should be RegNo = VIN (entered as RegNumber).&nbsp; </div><div><br> </div><div>So we need to make adaption on following 2 methods, so that Drive can fetch valuation/state report records without any confusions:&nbsp; </div><div><br> </div><div><ul><li>GetValuationByVehicle<br> </li><li>GetStateReportsByRegNoOrVin<br> </li> </ul><div><br> </div> </div><div><b>Note:&nbsp;</b> </div><div><ul><li>GetValuationByVehicle is used by both Bilink and Drive. Considering the testing scope for the May-RT, applying the changes ONLY for Drive.&nbsp;<br> </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17323','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-27 14:03:37.13+05:30','2024-05-27 17:43:11.043+05:30','2024-05-27 17:43:11.043+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-27T08:42:01.937Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-27T09:23:21.983Z"}, {"status": {"newValue": "Done", "oldValue": "In TQA"}, "changedAt": "2024-05-27T12:13:11.043Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|169','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:18:36.866793+05:30','17336','As a developer, I want to have a new endpoint for sample report','<div>We should have a new <b>public</b>&nbsp;endpoint to fetch a sample report and return a sample JSON. We need two separate reports for SE and NO, but the content will be similar. </div><div><br> </div><div>We need a SE and NO registration and mileage to use as a sample. </div><div><br> </div><div>We might need to hide registration number, just show defects. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17336','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-27 15:54:59.373+05:30','2024-06-07 10:41:05.387+05:30','2024-06-07 10:41:05.387+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-30T08:17:42.38Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-05-30T10:41:44.957Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Blocked_Dev"}, "changedAt": "2024-06-04T10:10:43.007Z"}, {"status": {"newValue": "Done", "oldValue": "Development In Progress"}, "changedAt": "2024-06-07T05:11:05.387Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|173','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17366','As a developer, I want to remove unnecessary logics in valuation reading page','<div>When loading valuation readings (Avlesniger), we include the valuation images as well as part of the response. However, these images are not used in UI. </div><div><br> </div><div>It''s a performance wastage as we do some image related processing. Check this:&nbsp; </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/dffdc050-e5d7-4cf6-bc1d-95edc12b6ba5?fileName=image.png" alt=Image><br> </div><div><br> </div><div>So remove the above code blocks.&nbsp; </div><div><br> </div><div>Note:&nbsp; </div><div><ul><li>It has impact to SA as well&nbsp; </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17366','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-28 18:42:02.27+05:30','2024-05-28 18:42:02.27+05:30','2024-05-28 18:42:02.27+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18519','As a user, I would like to see proper message when trying to create valuation for a heavy vehicle','<div>This is to block heavy vehicle creation based on object type on Platform 3, since we are going to support only light vehicles.<br> </div><div><br> </div><div>Should we block all other object types other than light vehicles? Yes </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18519','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-27 08:21:13.477+05:30','2024-06-27 08:21:13.477+05:30','2024-06-27 08:21:13.477+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14037','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17388','As a user,  I want to see only approved procedures and documentations on Kompetence','<div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">With regard to showing unapproved procedures/documents on P2 tasks, when checking the history found it was specifically done only for tasks (back in 2017 January). </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">The idea seems linking the tasks<span>&nbsp;</span><b style="box-sizing:border-box;">when drafting a procedure/document</b>, and see them inside tasks for reference. So, no need to wait until a procedure is approved to create the task links. </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">Except tasks, other areas we only consider only the approved ones. </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">So, we are going to show only the approved ones for Kompetence as well. </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17388','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-29 15:50:10.353+05:30','2024-05-29 15:50:10.353+05:30','2024-05-29 15:50:10.353+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:21:35.408558+05:30','17390','As a PO, I would like two updates to the website','<div>Issue 1: Remove PlusOffice and Moe Mekaniske Verksted from the Norwegian &quot;Partnere&quot; page </div><div>Issue 2: Employee updates &nbsp;NOR, SWE, ENG sites </div><div><ul><li>Remove Kevin , Sohan, Dileepa , Harshana </li><li>Add QAs : Ruwanthi , Ridmi </li> </ul> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/cb1d1831-d172-479c-b1ca-8d63138777cd?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17390','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-29 16:06:49.893+05:30','2024-07-08 18:46:29.48+05:30','2024-07-08 18:46:29.48+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-05T10:56:34.227Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-05T12:54:19.697Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-08T04:24:07.313Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-08T07:09:19.227Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-08T10:32:01.89Z"}, {"status": {"newValue": "UAT", "oldValue": "Business QA"}, "changedAt": "2024-07-08T12:28:18.407Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "changedAt": "2024-07-08T13:16:29.48Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|lauren@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:21:35.408558+05:30','17391','As a PO I want to change the add assignee flow when add from main screen ','<div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="color:rgb(237, 92, 87);"><b>UAT: Du kan se i prod at det er et ekstra steg i denne flyten. Nå kan du verifisere i test at det ekstra (duplisert) steg er fjernet.</b></span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><b><br></b> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="color:rgb(237, 92, 87);"><b>Flyt: Admin bruker klikker &quot;Legg til deltager&quot; enten fra blå + boks eller fra Help pop-up. Så søker man et kurs, ikke finner resultatet, så klikker &quot;Legg til nytt kurs&quot;</b></span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="color:rgb(237, 92, 87);"><b>Da skal du komme til &quot;opprett kurs&quot; view hvor du legger inn all kurs info, vedlegg, osv.&nbsp;</b></span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="color:rgb(237, 92, 87);"><b>&nbsp;</b></span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><span style="color:rgb(237, 92, 87);"><b>Sjekk også at dette funker likedan når du begynner fra Tile &quot;Alle kurs&quot; og gjør det samme</b></span> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;">We have a flow that seems to add extra steps. Add participant &quot;legg til deltager &quot;  then search for course but cannot find the right course, click «legg til nytt kurs» (should come to image inserted here) but then need to search  again and click &quot;Legg til kurs&quot; </div><div style="font-family:Calibri;font-size:14.6667px;text-align:left;">(So, should come directly to the image inserted here when clicking &quot;Legg til kurs&quot; the first time) </div><div style="text-align:left;"><div style="font-family:Calibri;font-size:14.6667px;"><img src="data:image/png;base64,"> </div><div style="font-family:Calibri;font-size:14.6667px;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;">We should skip the second screen (search course screen) after the initial &quot;Legg till kurs&quot; click </div><div style="font-family:Calibri;font-size:14.6667px;"><br> </div><div style="font-family:Calibri;font-size:14.6667px;">Note:&nbsp; </div><div><ul><li><font face=Calibri><span style="font-size:14.6667px;">From All course grid user search and create a course flow. Whether needs to fix here? Confirm with PO</span></font> </li> </ul> </div>Note-28-06-2024 :Confirmed with LH, Should still get directed to the create course with even when the user navigated directly from the All courses grid. </div><br> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17391','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-29 16:18:50.73+05:30','2024-07-02 17:27:08.183+05:30','2024-07-02 17:27:08.183+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-27T07:25:13.55Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-28T11:31:34.287Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-01T04:06:01.42Z"}, {"status": {"newValue": "UAT", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-02T06:14:11.61Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "changedAt": "2024-07-02T11:57:08.183Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NadeeshaG@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:37.29432+05:30','18532','As a user, I would like to see vehicle details','<div><b>Finalised AC :&nbsp;</b><br><ul><li>When user clicks on Reg number, vehicle info will be display in side drawer.&nbsp; </li><li>Content will be same as &quot;Registration number Tab&quot; in p2 valuation as below. </li> </ul><div style="display:inline-flex;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/a35b1dab-b013-4584-95f5-0f4c6178ca90?fileName=Screenshot%202024-07-10%20at%2019.26.43.png" alt="Screenshot 2024-07-10 at 19.26.43.png" style="width:137px;height:236px;" width=137 height=236><div style="height:7px;background-color:rgb(219, 98, 108);cursor:nw-resize;top:-3px;left:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:ne-resize;top:-3px;right:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:sw-resize;bottom:-3px;left:-3px;"> </div><div style="height:7px;background-color:rgb(219, 98, 108);cursor:se-resize;bottom:-3px;right:-3px;"> </div><div style="border:1px solid rgb(219, 98, 108);pointer-events:none;"> </div> </div> </div><div><br> </div><div><ul><li>Vehicle data could be a separate component so that can be used on different places. </li> </ul> </div><div>Mockup for P3 </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/b4b661c7-ed7f-4b37-8d22-b932de06f4d3?fileName=Screenshot%202024-07-10%20at%2019.23.11.png" alt="Screenshot 2024-07-10 at 19.23.11.png" style="width:565px;height:82px;" width=565 height=82><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/015aadf6-8cd0-4fad-9f96-4438dbdb5a42?fileName=Screenshot%202024-07-10%20at%2019.22.27.png" alt="Screenshot 2024-07-10 at 19.22.27.png" style="width:567px;height:339px;" width=567 height=339><br> </div><div><br> </div><div>Should be able to support both disabled, and editable modes </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18532','{"category": "User Story"}',NULL,'{"category": "Blocked_Dev"}',NULL,NULL,'2024-06-27 09:06:36.643+05:30','2024-07-29 16:30:45.98+05:30','2024-07-29 16:30:45.98+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-04T08:18:52.7Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-04T08:56:36.993Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-12T08:47:16.93Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-07-29T11:00:45.98Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17405','As a developer I want to improve the load time when loading course details (course view/instance pages) and similar courses grid in (search and create new course page)','<div>It was observed that the loading of course logos together with course detail fields, at times prolong the loading time for course details load in<br><ul><li>course view,&nbsp; course instance, similar courses page (when opening a course record to see details) </li> </ul>and in similar courses grid the record load time is slower due to the logos being loaded together with the results. </div><div><br> </div><div>We may reduce the time by asynchronously loading the course logo(s) in a separate call&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17405','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-30 11:44:18.14+05:30','2024-05-30 11:44:18.14+05:30','2024-05-30 11:44:18.14+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|HarshanaE@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17428','As PO, I would like to hide the SA tab for maintaining course plans','<div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);"> </div><div style="box-sizing:border-box;"><span style="">We have a feature on P2 where we maintain a list of course plans on SA (just the name and category) to use for fresh units on PS to create new courses.</span><br> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">Story created for this several years ago: </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/515c1c20-ae4e-4c5b-b925-1e21fd7292a0?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;"><br style="box-sizing:border-box;"></span> </div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;">On SA:</span> </div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;">&nbsp;</span> </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3f55d7b5-9ac3-4066-a2b1-856465b1f538?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">On PS: </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/ca6d44b7-1762-4b0e-8baa-e63385f48710?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">Since the way we work on P3 is totally different than this, maintaining course plans on SA is not needed anymore, and we can hide the tab. </div><br><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17428','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-05-30 14:00:54.07+05:30','2024-05-30 14:00:54.07+05:30','2024-05-30 14:00:54.07+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','17497','As a developer, I want to setup localization in backend','<div>We want to update localization for the OI, so that POs can update the strings themselves. For this, we need to store the JSON file in the Azure and setup an API for fetching the contents of this file, as it is done in kompetense. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17497','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-31 12:22:57.963+05:30','2024-06-12 14:15:17.11+05:30','2024-06-12 14:15:17.11+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-11T04:09:48.457Z"}, {"status": {"newValue": "Done", "oldValue": "Development In Progress"}, "changedAt": "2024-06-12T08:45:17.11Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|173','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:37.29432+05:30','18539','As a user i want to check additional info for Carweb valuations','<div><span style="font-family:&quot;Aptos Narrow&quot;;font-size:14.6667px;display:inline !important;">For carweb valuations currently we have a new tab for “Additional Information” , This should display in p3 as well</span><br> </div><div> </div><div><span style="font-family:&quot;Aptos Narrow&quot;;font-size:14.6667px;display:inline !important;"><br></span> </div><div><span style="font-family:&quot;Aptos Narrow&quot;;font-size:14.6667px;display:inline !important;">Note:&nbsp;</span> </div><div><ul><li><font face="Aptos Narrow"><span style="font-size:14.6667px;">We can add this under BUStest Scope</span></font> </li> </ul><span style="font-family:&quot;Aptos Narrow&quot;;font-size:14.6667px;display:inline !important;"></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18539','{"category": "User Story"}',NULL,'{"category": "Blocked_Dev"}',NULL,NULL,'2024-06-27 09:23:20.57+05:30','2024-07-12 10:30:45.497+05:30','2024-07-12 10:30:45.497+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-04T08:56:55.43Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-07-12T05:00:45.497Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:17.048695+05:30','18541','As a user, I want to have the OBD section on valuations page','<div><b>Finalised AC</b> </div><div><br> </div><div>We can use below components to show the OBD section on the valuations page </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/14048" data-vss-mention="version:1.0">#14048</a>&nbsp; </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/14046" data-vss-mention="version:1.0">#14046</a>&nbsp; </div><div><a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/14045" data-vss-mention="version:1.0">#14045</a>&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18541','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-27 09:43:41.177+05:30','2024-06-27 09:43:41.177+05:30','2024-06-27 09:43:41.177+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14037','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	(NULL,'2024-07-30 12:28:17.048695+05:30','14037',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:04.137967+05:30','18602','As a developer, I want to remove eager loading unnecessarily for unused CourseSupplier Property in Internal courses','<div>It was observed that in few places we eager load CourseSupplier when querying QualityCoursePlans where it was removed as per <a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/17798" data-vss-mention="version:1.0">#17798</a>&nbsp; </div><div><br><br>Identified impacted areas,<br><ul><li>All employee course assignments&nbsp;<span style="display:inline !important;">(when loading internal course instances and unscheduled internal courses)</span> </li><li><span style="display:inline !important;">My courses (when loading<span style="display:inline !important;"><span>&nbsp;</span>internal course instances and</span>&nbsp;unscheduled internal courses)<br></span> </li><li style="box-sizing:border-box;">Loading similar internal courses (searching for courses in create new page) </li><li style="box-sizing:border-box;">Loading unit courses in all courses grid (unit course tab and the tab that displays both types)<br style="box-sizing:border-box;"> </li><li style="box-sizing:border-box;">When loading course details for internal course/course assignment&nbsp; </li> </ul> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18602','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-28 10:45:19.45+05:30','2024-07-04 16:38:51.86+05:30','2024-07-04 16:38:51.86+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-28T07:00:48.997Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-28T09:33:00.86Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-03T09:34:29.767Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-04T04:28:30.14Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-07-04T11:08:51.86Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|HarshanaE@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18613','As an architect, I want to upgrade Entity Developer on entire P3 server side','<div>This is the tool used to generate EF Core model on server side. Time to upgrade it to the latest version. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18613','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-28 13:46:31.863+05:30','2024-07-09 04:23:37.873+05:30','2024-07-09 04:23:37.873+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-03T13:53:06.277Z"}, {"status": {"newValue": "Done", "oldValue": "Development In Progress"}, "changedAt": "2024-07-08T22:53:37.873Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17929','Azure-Workitems|SAMPLE-AS-Norway|feng@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:24:37.29432+05:30','18615','As a user, I would like to have a image container','<div><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Main picture is displayed in large size </li><li style="box-sizing:border-box;">Should be able to drag and set the main picture </li><li style="box-sizing:border-box;">Should be able to drag and change the sequence of the image </li> </ul> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/97b2031a-3899-43cc-ba64-665f04e8fa04?fileName=image.png" alt=Image><br> </div><div><span style="box-sizing:border-box;"><span style="box-sizing:border-box;display:inline !important;">File uploader can be referred from&nbsp;</span><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18904" style="box-sizing:border-box;cursor:pointer;">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18904</a></span> </div><div><br> </div><div>We provide a guidance if there are no files at all (By clicking reference). </div><div><br> </div><div>At least one image should be there (same as on P2). </div><div><br> </div><div>For the empty ones, we show the default thumbnail on the 6 places. </div><div><br><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/1b65e294-758f-487d-a9b9-a713dfcb4126?fileName=Screenshot%202024-07-12%20at%2011.58.53.png" alt="Screenshot 2024-07-12 at 11.58.53.png"><br> </div> </div><div><br> </div><div>When clicked on a single image, we need to load&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19038">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19038</a> </div><div><br> </div><div>When clicked on See more, we need to load the same component on a side drawer with the full image list.&nbsp; </div><div><br> </div><div><b>Initial AC:</b> </div><div><br> </div><div> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/6076ee44-4d3e-4239-9cef-794e96402b85?fileName=image.png" alt=Image><br> </div><div><ul><li><strike>Profile picture on the first page </strike> </li><ul><li><strike>Big picture on the layout </strike> </li> </ul><li><strike>There are certain mandatory pictures </strike> </li><ul><li><strike>Eg: Pictures from different sides of the vehicle </strike> </li><li><strike>How to define this? based on the report settings </strike> </li> </ul><li><strike><span>This same component to be used on valuations, work orders and state reports as well</span><br> </strike> </li><li><strike>Changes on state report should not automatically update on valuation </strike> </li><ul><li><strike>As long as the state report is not concluded, when updating images on valuation, and when going to state report, the images should be automatically updated<br> </strike> </li><li><strike>Once the state report is concluded, and if the valuation is reopened later, the changes won''t be reflected on the existing state report. So, the user should create a new state report in order to reflect those changes. </strike> </li><li><strike>Note: Logs would have the information reopening valuations and all </strike> </li><li><strike>This flow of info is common for any other information as well </strike> </li><li><strike>Same for removing of images and any other data as well </strike> </li><li><strike>There should be a warning if a state report is concluded and the user is trying to update info/images on a work order or valuation, asking the user to create a new state report to reflect the new changes </strike> </li><li><strike>Technical </strike> </li><ul><li><strike>When sharing the images, no need to clone the files, but can reference to the same file on the data lake </strike> </li><li><strike>When concluding an item, we can take a snapshot, so that we don''t lose the data and otherwise we can share the common data among multiple items </strike> </li> </ul> </ul> </ul> </div><div><strike><span style="display:inline !important;">File uploader can be referred from&nbsp;</span><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18904" style="box-sizing:border-box;cursor:pointer;">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18904</a></strike><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18615','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-06-28 14:05:20.313+05:30','2024-07-05 10:12:53.43+05:30','2024-07-05 10:12:53.43+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-05T04:42:53.43Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18859','Custom Features','<div>Here we consider any customizations we have done only for specific cases </div><div>Eg: Viking specific features, BMW pricing changes,&nbsp;<span style="display:inline !important;">Shared valuations</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18859','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-08 12:04:50.483+05:30','2024-07-08 12:04:50.483+05:30','2024-07-08 12:04:50.483+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:30:53.449807+05:30','18891','User Guidance','<div>Creating this to address any similar requirements we had on Kompetance on BUStest as well&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18891','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 10:49:18.213+05:30','2024-07-09 10:49:18.213+05:30','2024-07-09 10:49:18.213+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:30:54.135385+05:30','18393','BUStest 2025 V2',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18393','{"category": "Epic"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-24 08:09:31.54+05:30','2024-06-24 08:09:31.54+05:30','2024-06-24 08:09:31.54+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|SamraA@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18635','As a user, I would like to prepare the overall application template','<div>Prepare the overall template to place the components. </div><div><br> </div><div>This itself could be another component. </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/526e49d2-4119-4645-8b94-0d59c70a3343?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Bind the profile details like user and unit information as needed. </div><div><br> </div><div><div style="box-sizing:border-box;"><b style="box-sizing:border-box;">Technical notes:</b> </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Since we show the different types (valuations, work orders, state reports) at different places, we can load them on different API calls for better performance. </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Consider splitting other data as well like defects etc. to load them in parallel. </li><li style="box-sizing:border-box;">We can show a spinner in each section to show the progress of loading. </li> </ul> </ul> </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">On UI we can show the thumbnails, and load the actual image only when needed. </li> </ul> </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18635','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-30 10:57:09.157+05:30','2024-06-30 10:57:09.157+05:30','2024-06-30 10:57:09.157+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18125','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18636','As a user, I would like to see the results for a search','<div><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Multiple report types could be there for one record of valuation here </li><li style="box-sizing:border-box;">Using the context menu should have the report types attached with the valuation to print the report directly </li><li style="box-sizing:border-box;">Other context menu features </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Copy </li><li style="box-sizing:border-box;">Open </li><li style="box-sizing:border-box;">Preview (reports described above) </li><li style="box-sizing:border-box;">Send/Email </li><li style="box-sizing:border-box;">Delete </li><li style="box-sizing:border-box;">Log (history of the car) - can show on a slider </li> </ul><li style="box-sizing:border-box;">If the vehicle search doesn''t have any items, we show the UI empty </li> </ul> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/42142637-7bc2-47ff-a0ae-bdcaade25770?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18636','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-30 11:03:03.31+05:30','2024-06-30 11:03:03.31+05:30','2024-06-30 11:03:03.31+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18125','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18639','As a user I would like to show tab view for valuations, work orders and state reports','<div style="box-sizing:border-box;">Now valuations, work order, state reports here and there.&nbsp; </div><div style="box-sizing:border-box;">On P3 we come up with a tab structure to make it on the same place (after searching a vehicle). </div><div style="box-sizing:border-box;"><br> </div><div style="box-sizing:border-box;">Left side tab bar is only applicable on the dashboard screen </div><div style="box-sizing:border-box;"><ul><li>No need to have this left side tab bar inside valuations/work orders/state reports, since user can navigate to the previous tabs via the breadcrumb. </li> </ul> </div><div style="box-sizing:border-box;"><br> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/a141c376-e6be-4e4f-9ea1-2ec558eb57ee?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">Only the linked items we are considering here. </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><br><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18639','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-30 11:14:35.803+05:30','2024-06-30 11:14:35.803+05:30','2024-06-30 11:14:35.803+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18125','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18641','As a user I would like to have the inspection data together with vehicle info','<div>Having inspection data below this vehicle grid<br> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/42142637-7bc2-47ff-a0ae-bdcaade25770?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18641','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-30 11:22:42.883+05:30','2024-06-30 11:22:42.883+05:30','2024-06-30 11:22:42.883+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:04.137967+05:30','18652','As a Developer, I want to set fileReference when fetching files from P2','<div>When GetFiles method called from P2 application, we should have a file reference for each files.&nbsp; </div><div><br> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18652','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-01 10:22:15.28+05:30','2024-07-09 16:43:29.173+05:30','2024-07-09 16:43:29.173+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-01T12:14:16.677Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-03T08:41:35.053Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-09T06:27:39.8Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-09T11:13:29.173Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:04.137967+05:30','18653','As a developer, I want an API to get receipt content','<div>We want to add a new functionality for users to be able to view and download payment receipt pdf from the profile section. In order to do that, we need to get receipt content from the backend. </div><div><br> </div><div>Input:&nbsp;purchaseHistoryId </div><div>Output: all the data necessary to create a receipt with the same text as in the email receipt. Example: </div><div><span>Köp: Oscar inspector rapport</span><div>Totalbelopp: 49 SEK </div><div>Brutto: 49 SEK </div><div>Netto: 36,75 SEK </div><div>Moms: 12,25 SEK </div><div>Moms: 25% </div><div>Betalsätt: Swish </div><div>Betalningsreferens: 2803 </div><div>Datum: 2024-07-01 09:19:00 </div><span>Momsregistreringsnummer: SE559408530901</span><br> </div><div><span><br></span> </div><div>We need to restrict this API, so that users are only able to fetch this data if receipt belongs to the user. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18653','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-01 13:31:33.183+05:30','2024-07-10 08:31:34.6+05:30','2024-07-10 08:31:34.6+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-01T11:20:23.7Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-05T06:10:47.56Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-05T08:47:27.667Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-09T11:13:54.94Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-10T03:01:34.6Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:24:04.137967+05:30','18655','As a Developer, I want to extend file server security to fetch files from BUSpekLink and BUStestLink','<div>Should possible to use RestAPI file server with BUSpekLink token and BUStestLink Token&nbsp; </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18655','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-01 16:33:52.433+05:30','2024-07-08 10:49:08.043+05:30','2024-07-08 10:49:08.043+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-01T11:04:45.15Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-01T11:44:25.46Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-03T07:45:23.81Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-08T05:19:08.043Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
	(NULL,'2024-07-30 12:28:46.170651+05:30','5687',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18668','As a developer, I would like to keep the claims on server side and not on client side','<div>For security purposes, we can keep the&nbsp;claims on server side and not on client side. </div><div><br> </div><div>So, client works just as an interface and actual security info is on server side. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18668','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-01 17:05:06.593+05:30','2024-07-01 17:05:06.593+05:30','2024-07-01 17:05:06.593+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|5687','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18695','As a PO, I want to do the necessary updates in Sample Inspection to comply with SVV''s new regulations','<div style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">From 1 January 2025, the control body must collect data on cars'' actual fuel consumption, so-called OBFCM data, when the cars are in for periodic checks. The control bodies must transfer this data to the Norwegian Road Administration. The Norwegian Public Roads Administration therefore wants the control body to be notified that a vehicle is applicable for reading and transferring OBFCM data, both when asking about control type and when creating a new control slip.&nbsp;</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/03757e33-4c27-449e-89cc-8004064e9815?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"></span> </li> </ul></span> </div><div style="box-sizing:border-box;"><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">From 10 June 2024, a new field stating whether the data provider must display a warning will be available in our test environment. The field will provide information that a warning must be displayed in their solutions when creating a P control and for queries on control type for vehicles that must have P control, for petrol and diesel cars (including hybrid) in the categories M1 and N1 (including M1G and N1G ) which is registered for the first time as of 2021.<span>&nbsp;</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><span style="box-sizing:border-box;">Text to be displayed:&nbsp;«Kjøretøyet er aktuelt for avlesning og overføring av OBFCM-data».</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Display a banner, same as how we display the protected vehicle&nbsp;</span> </li> </ul> </ul> </div> </div><br><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18695','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-02 14:37:02.843+05:30','2024-07-02 14:37:02.843+05:30','2024-07-02 14:37:02.843+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18134','Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18696','As a PO, I want to do the necessary updates in BUSpek App to comply with SVV''s new regulations','<div><div style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">From 1 January 2025, the control body must collect data on cars'' actual fuel consumption, so-called OBFCM data, when the cars are in for periodic checks. The control bodies must transfer this data to the Norwegian Road Administration. The Norwegian Public Roads Administration therefore wants the control body to be notified that a vehicle is applicable for reading and transferring OBFCM data, both when asking about control type and when creating a new control slip.&nbsp;</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/03757e33-4c27-449e-89cc-8004064e9815?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"></span> </li> </ul></span> </div><div style="box-sizing:border-box;"><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">From 10 June 2024, a new field stating whether the data provider must display a warning will be available in our test environment. The field will provide information that a warning must be displayed in their solutions when creating a P control and for queries on control type for vehicles that must have P control, for petrol and diesel cars (including hybrid) in the categories M1 and N1 (including M1G and N1G ) which is registered for the first time as of 2021.<span>&nbsp;</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><span style="box-sizing:border-box;">Text to be displayed:&nbsp;«Kjøretøyet er aktuelt for avlesning og overføring av OBFCM-data».</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Display a banner, same as how we display the protected vehicle&nbsp;</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Text should display in inspection creation popup, edit<span>&nbsp;</span></span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">inspection</span><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">&nbsp;and vehicle search (same as the protected vehicle)</span> </li> </ul> </ul> </div> </div><br><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18696','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-07-02 14:37:27.84+05:30','2024-07-23 14:03:33.603+05:30','2024-07-23 14:03:33.603+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-23T08:33:33.603Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18134','Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:19:35.036813+05:30','17506','[SEO] As a developer, I want to update how OI is displayed in google','<div><span>More details in the parent Feature. This is part of the larger change for SEO. Tasks in this story:</span> </div><div><span><br></span> </div><div><ul><li><span style="">Update title and description tags:</span><br> </li><ul><li>Value for new title &nbsp;- &nbsp;<span style="color:rgb(134, 17, 6);">[value]</span> </li><li>Value for new description - <span style="color:rgb(134, 17, 6);">[value]</span> </li> </ul><li><span>Update logo icon</span> </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17506','{"category": "User Story"}',NULL,'{"category": "Blocked_Dev"}',NULL,NULL,'2024-05-31 12:43:33.47+05:30','2024-07-22 08:22:37.14+05:30','2024-07-22 08:22:37.14+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-04T13:29:19.463Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-12T06:15:07.537Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-13T04:53:34.213Z"}, {"status": {"newValue": "Blocked_QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-19T05:58:34.99Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "Blocked_QA"}, "changedAt": "2024-07-02T09:04:52.823Z"}, {"status": {"newValue": "Reopened", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-02T10:02:09.94Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Reopened"}, "changedAt": "2024-07-22T02:52:37.14Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17266','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','18700','[SEO] As a QA, I want to update how OI is displayed in google search','<div>Currently, when we search for Oscar Inspector in Google, it will be displayed below </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/975cfa8a-cc61-4bb3-a0ed-2eb32557369d?fileName=image.png" alt=Image><br> </div><div><br> </div><div><br> </div><div>As per the comment in <a href="#" data-vss-mention="version:2.0,3305a97a-c961-6eab-aa20-e2d5338efc25">@Simon Ahlberg</a>, If we search some more keywords like ''Oscar Innscpector Contact US'', we should display the Oscar Inspector Contact Us link in search results </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/ccd9f7cf-159a-43ec-ad6a-aa6642719561?fileName=image.png" alt=Image><br> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18700','{"category": "User Story"}',NULL,'{"category": "Blocked_Dev"}',NULL,NULL,'2024-07-02 15:18:10.837+05:30','2024-07-22 08:49:34.737+05:30','2024-07-22 08:49:34.737+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T02:52:48.58Z"}, {"status": {"newValue": "Blocked_Dev", "oldValue": "Development In Progress"}, "changedAt": "2024-07-22T03:19:34.737Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17506','Azure-Workitems|SAMPLE-AS-Norway|chathusarat@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:24:04.137967+05:30','18703','As a PO, I want to adapt FileServer RestAPI in P2 Tasks in ProductSuite','<ul><li>When a new file upload to tasks, it should upload to Azure blob storage </li><ul><li>Tasks - BUSkvalitet/Tasks/&lt;Task_ID&gt;/ </li><li>Task Instance -&nbsp;BUSkvalitet/TaskInstances/&lt;TASK_INSTANCE_ID&gt;/ </li> </ul><li>This is applicable for all the files (file upload, scan and upload file, google drive files) </li> </ul><div>Note:&nbsp; </div><div><ul><li>In this story, only ProductSuite will cover. SA tasks and Tasks in BK app will consider seperately in below stories:&nbsp;<br> </li><ul><li><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19047">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19047</a><br> </li><li><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19048">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19048</a><br> </li> </ul> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18703','{"category": "User Story"}',NULL,'{"category": "Business QA"}',NULL,NULL,'2024-07-02 19:19:31.34+05:30','2024-07-16 17:13:00.61+05:30','2024-07-16 17:13:00.61+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-02T13:50:10.557Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-11T15:15:33.517Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-12T05:30:10.167Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-15T02:25:22.973Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-16T11:43:00.61Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18717','As a user, I would like to load P3 BUStest when accessing BUStest tab on P2','<div>Load P3 BUStest when accessing BUStest tab on P2.<br> </div><div> </div><div><br> </div><div>Need a way to identify for which units we allow the users to use P3 BUStest (<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18882">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18882</a>) </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18717','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-03 09:24:37.72+05:30','2024-07-03 09:24:37.72+05:30','2024-07-03 09:24:37.72+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18716','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18807','As a user, I would like to have settings for test types','<div>What type of checkpoints we need to consider. And the properties like </div><div><ul><li><span>Standard prices for defect</span><br> </li><li><span>Whether it''s mandatory</span> </li><li><span>Actions/positions</span> </li><li><span>etc.</span> </li> </ul><div>2 prices based on the checkpoint </div><div> </div><div><ul><li><span>One for internal use (this is the actual cost)</span> </li><ul><li><span>This should not be shown for external users</span> </li> </ul><li><span>One for external use</span> </li> </ul><span>Different prices based on the actions as well</span> </div><div><br><div>Report would be based on these properties. </div><div><br> </div><div>Who should have the access should also be configured. No need to consider this in the initial stage, and this part would be covered with&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18808">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18808</a> </div><div><ul><li>Group admins </li><li>Specific dealers </li><li>etc. </li> </ul> </div> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18807','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-04 12:08:32.667+05:30','2024-07-04 12:08:32.667+05:30','2024-07-04 12:08:32.667+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14056','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:28:46.170651+05:30','18808','As PO, I would like to decide which components/sections should be accessed by which levels','<div>Initially we build the components without considering the security on who can access which components. </div><div><br> </div><div>Then we need to decide which components should be accessed by which levels (SA/GA/Admin etc. based on the permissions)<br> </div><div><br> </div><div>The restrictions could be applied on a part inside a component as well. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18808','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-04 12:37:26.013+05:30','2024-07-04 12:37:26.013+05:30','2024-07-04 12:37:26.013+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18124','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18809','As a user, I would like to apply security controls on APIs which can be consumed without the UI','<div>With gql, we could simply avoid retrieving the unwanted properties. </div><div><br> </div><div>However if someone tried to retrieve a restricted property, it should be restricted with rules. </div><div><ul><li>AOP could be used here </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18809','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-04 12:59:25.313+05:30','2024-07-04 12:59:25.313+05:30','2024-07-04 12:59:25.313+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18124','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18860','As a Viking user, I would like to have Viking specific functionalities',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18860','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-08 12:07:04.87+05:30','2024-07-08 12:07:04.87+05:30','2024-07-08 12:07:04.87+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18859','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18124','Security Integration','<div><span style="display:inline !important;">This included several areas when it comes to security</span><br> </div><div><div><ul><ul> </ul> </ul> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18124','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-14 08:55:33.837+05:30','2024-06-14 08:55:33.837+05:30','2024-06-14 08:55:33.837+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18878','As a user, I would like to have a video upload','<div>Should be able to upload videos </div><div><ul><li>No on screen recording like on P2 (If we use native camera app directly (images/videos together), may not be able to support on application recording) </li> </ul> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/bd0a72c2-0873-45cb-b583-d1954a83fbec?fileName=image.png" alt=Image><br> </div><div><br> </div><div>Same file uploader component can be reused. </div><div><br> </div><div>When clicked on a video, we show a preview </div><div><ul><li>Should be able to re use the component we create for images&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19038">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19038</a> </li><li>If too complex, we can create separate component for videos </li> </ul><div>Technical info: We should support streaming here, without downloading the complete video </div> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/04000008-fdb5-4b25-b703-05b81638a0e7?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18878','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 08:20:16.543+05:30','2024-07-09 08:20:16.543+05:30','2024-07-09 08:20:16.543+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18879','As a user, I would like to have a file list view container','<div>Context menu options </div><div><ul><li>Download </li><li>Preview - when clicked on a file, preview should happen </li><ul><li>If the file is not preview-able, it would be downloaded (Eg: zip) </li> </ul><li>Delete </li> </ul> </div><div><br> </div><div>Read only view should be supported by, </div><div><ul><li>Removing file upload </li><li>Removing delete </li> </ul> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/3abd48ad-7ab9-4abc-ba9b-fd506521c533?fileName=image.png" alt=Image> </div><div><br> </div><div>File uploader can be referred from&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18904">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18904</a> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18879','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 08:49:58.173+05:30','2024-07-09 08:49:58.173+05:30','2024-07-09 08:49:58.173+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18880','As a user, I would like to hide the unnecessary sections on P2','<div><span style="display:inline !important;">Hide report settings, as they would not be used.</span><br> </div><div><span style="display:inline !important;">Identify any other sections to be hidden as well.</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18880','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 09:20:25.517+05:30','2024-07-09 09:20:25.517+05:30','2024-07-09 09:20:25.517+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18716','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18716','P2 Changes','<div>P2 existing items would be read only when a unit starts to use P3 BUStest. </div><div><br> </div><div><span style="display:inline !important;">Remove report settings, as they would not be used.</span><br> </div><div><span style="display:inline !important;"><br></span> </div><div>Any other restrictions should we have for those users? </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18716','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-03 09:23:35.87+05:30','2024-07-03 09:23:35.87+05:30','2024-07-03 09:23:35.87+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:25:08.088763+05:30','18893','As a developer, I would like to have new API for Vehicle related operations','This story is regarding setting up a new API for vehicle specific operations. Any common operation for BUSTest and BUSSpek will be in this API.<br><br><b>Endpoint:</b>&nbsp;<a href="https://test.bus.no/BUSPlatform3/Vehicle.Server/BUS.APIs.GraphQLServer.P3.Vehicle.tool/">https://test.bus.no/BUSPlatform3/Vehicle.Server/BUS.APIs.GraphQLServer.P3.Vehicle.tool/</a><br><br><b>Test query:</b><br><div style="color:#cbd0db;background-color:#212d46;font-family:''Fira Code'', Consolas, ''Courier New'', monospace;font-weight:500;font-size:13px;line-height:18px;"><div><span style="color:#3cb1e9;">query</span><span>&nbsp;</span><span style="color:#57bfac;">{</span> </div><div><span>&nbsp; </span><span style="color:#ff44a4;">vehicle_QueryTest</span> </div><div><span style="color:#57bfac;">}</span> </div> </div><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18893','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-09 11:11:35.293+05:30','2024-07-22 16:16:20.297+05:30','2024-07-22 16:16:20.297+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-09T11:09:37.43Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-11T06:04:38.01Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-17T07:28:41.273Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-22T10:46:20.297Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18892','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','18894','As a developer, I would like to prepare Production resources',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18894','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 11:12:36.277+05:30','2024-07-09 11:12:36.277+05:30','2024-07-09 11:12:36.277+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18892','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:29:52.678324+05:30','19050','As a user, I would like to see OI indicator on checkpoint groups if there are related defect predictions','<div>Show OI indicator on checkpoint groups if there are related defect predictions.<br> </div><div><ul><li>Reddish, yellowish and orangish based on the percentage </li> </ul> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/366e0d62-b66b-4b2c-867d-827e05a66213?fileName=image.png" alt=Image><br> </div><div><br> </div><div>We need to find a way to map the P2 checkpoint ids on predictions with the P3 new model.<br> </div><div><br> </div><div>This is low priority as mentioned by Vidar. </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19050','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-13 12:51:07.977+05:30','2024-07-13 12:51:07.977+05:30','2024-07-13 12:51:07.977+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14037','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:25:08.088763+05:30','18902','As a PO, I want to update the default email in independently running services ','<div>The emails sent from independently running services (Eg: Overdue procedures. documents etc.) has to be sent from ''noreply@bus.no'' instead of ''firmapost@bus.no'' </div><div><br> </div><div>When SMTP settings hasn''t been added in a unit, by default all the emails sent through an independently running service should go from noreply@bus.no.&nbsp;<br><br><span>Independently running services <br></span><div><ul><li>TaskAlertingService - C:\Program Files (x86)\Default Company Name\BUS.TaskAlerting </li> </ul> </div><span><ul><li><span>VersioningNotification -&gt; C:\Program Files (x86)\Default Company Name\BUS.VersioningNotifications</span> </li> </ul><div>Note - The default email address was changed in the mobile server as well.&nbsp; </div></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18902','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-09 14:12:15.68+05:30','2024-07-12 10:10:25.857+05:30','2024-07-12 10:10:25.857+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-10T05:42:00.383Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-11T06:17:08.987Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-11T07:55:57.49Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-12T04:40:25.857Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ishrathr@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|180','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:25:08.088763+05:30','18903','As a PO, I want to update the default email in P3','<div>The emails in P3 have to be sent using ''noreply@bus.no'' instead of ''firmapost@bus.no'' if there are no SMTP settings included in the unit. </div><div><br> </div><div>When SMTP settings is not included then the below emails should be sent using &quot;noreply@bus.no&quot; email address. </div><div><div><br>Note - Any emails that''s being sent from P3 Kompetanse and OI has been modified. </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18903','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-09 14:14:43.457+05:30','2024-07-16 16:55:09.007+05:30','2024-07-16 16:55:09.007+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-11T06:09:06.023Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-16T05:03:33.537Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-16T05:05:54.173Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-16T10:12:30.16Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-07-16T11:25:09.007Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ishrathr@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|180','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','18904','As a user, I would like to have file uploader to reuse on file containers','<div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/e82b7cd9-82e1-4a0f-b63e-a7b566f1f505?fileName=image.png" alt=Image><br> </div><div><br> </div><div>We have a file uploader module used for Kompetence. </div><div><br> </div><div>Need to extend this existing one or create new component to use for BUStest </div><div><ul><li>Certain operations like opening camera is not supported there. </li> </ul><div>This could then be reused on </div><div><ul><li><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18615">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18615</a><br> </li><li><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18879">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18879</a><br> </li> </ul> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18904','{"category": "User Story"}',NULL,'{"category": "Blocked_QA"}',NULL,NULL,'2024-07-09 15:35:40.36+05:30','2024-07-29 10:24:21.55+05:30','2024-07-29 10:24:21.55+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-18T09:15:13.387Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-25T08:59:52.1Z"}, {"status": {"newValue": "Blocked_QA", "oldValue": "In TQA"}, "changedAt": "2024-07-29T04:54:21.55Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','18905','As a user, I would like to send work orders to the suppliers','<div>The Link for the suppliers needs to be generated to take the user into&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18505">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18505</a> </div><div><br> </div><div>Need mockups for this </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18905','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 16:07:07.617+05:30','2024-07-09 16:07:07.617+05:30','2024-07-09 16:07:07.617+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18372','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','18906','As a developer, I would like to integrate security into the TestLinks generated for the suppliers','<div>Integrate security into the TestLinks generated for the suppliers on&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18505">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18505</a><br> </div><div><br> </div><div>May need to register a new application or reuse the existing BUStestLink application? </div><div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18906','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-09 16:11:47.68+05:30','2024-07-09 16:11:47.68+05:30','2024-07-09 16:11:47.68+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18124','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19004','As a developer, I need to update the DB''s compatibility level on Prod DBs','<div>We need to update the DB''s compatibility based on the facts by&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/18899" target=_blank rel="noopener noreferrer" style="box-sizing:border-box;font-size:14.6667px;">Spike 18899</a><span style="box-sizing:border-box;font-size:11pt;">: As a developer, I need to investigate the reason for getting SqlException: Incorrect syntax near ''$''. after upgrading to Dotnet 8 - Database Compatibility Version. So please refer to the spike and proceed accordingly.</span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19004','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-07-10 18:19:10.53+05:30','2024-07-13 00:20:14.933+05:30','2024-07-13 00:20:14.933+05:30','[{"status": {"newValue": "Done", "oldValue": "New"}, "changedAt": "2024-07-12T18:50:14.933Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RoshanK@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|180','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19005','As a user, I would like to email a valuation','<div><b>Suggested solution</b> </div><div><ul><li>User able to share valuation as an email or as a test link. </li><li>By default both options marked &quot;checked&quot; for &quot;Send email&quot; &amp; &quot;Send testLink&quot;.&nbsp;Based on user preference he can unmark/mark this. </li><li>Here user can add. </li><ul><li><span></span><span></span><span>Testtype</span><br> </li><li><span><span></span><span></span><span>Til</span><br></span> </li><li><span><span><span></span><span></span><span> Kopi(;)&nbsp;<span style="box-sizing:border-box;">(This will display&nbsp;</span><span style="box-sizing:border-box;display:inline !important;">if marked&nbsp;</span><span style="box-sizing:border-box;display:inline !important;">&quot;<span style="box-sizing:border-box;display:inline !important;">Send email</span>&quot;</span><span style="box-sizing:border-box;display:inline !important;"><span style="box-sizing:border-box;">&nbsp;</span>as checked.)</span></span><br></span></span> </li><li><span><span><span><span></span><span></span><span>Emne</span><br></span></span></span> </li><li><span><span><span><span>Description&nbsp;<span style="box-sizing:border-box;">(This will display&nbsp;</span><span style="box-sizing:border-box;display:inline !important;">if marked&nbsp;</span><span style="box-sizing:border-box;display:inline !important;">&quot;<span style="box-sizing:border-box;display:inline !important;">Send email</span>&quot;</span><span style="box-sizing:border-box;display:inline !important;"><span style="box-sizing:border-box;">&nbsp;</span>as checked.)</span></span></span></span></span> </li><li><span><span><span><span><span></span><span></span><span>Mobiltelefon(;) (This field enable only if marked&nbsp;<span style="display:inline !important;">&quot;Send testLink&quot;</span> as checked.)</span></span></span></span></span> </li><li><span><span><span><span><span>Display check box :&nbsp;<span></span><span></span><span>Include owner information in the email (This will display&nbsp;</span><span style="display:inline !important;">if marked&nbsp;</span><span style="box-sizing:border-box;display:inline !important;">&quot;<span style="display:inline !important;">Send email</span>&quot;</span><span style="display:inline !important;"><span>&nbsp;</span>as checked.)</span></span><br></span></span></span></span> </li> </ul><li>User can preview testLink. Once they click on the link, it will open in a new tab.&nbsp; </li> </ul><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/e635d646-d5e8-4b53-9790-1962b756d761?fileName=Screenshot%202024-07-12%20at%2010.11.34.png" alt="Screenshot 2024-07-12 at 10.11.34.png" style="width:414px;height:430px;" width=414 height=430><br> </div><div><br> </div><div>--------------------------------------------------------------------------------------------------- </div><div><br> </div><div><b>Initial AC</b> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/a218e10b-ec89-4777-870f-bb9b33976014?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19005','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-11 08:40:32.073+05:30','2024-07-11 08:40:32.073+05:30','2024-07-11 08:40:32.073+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14037','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19006','As a user, I would like to have the preview of valuation TestLink','<div style="box-sizing:border-box;">Preview should be available for&nbsp;<span>TestLink</span> </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Technical info: should we go with dynamic token, without storing in DB, since this is just a preview </li> </ul><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/783e910d-1e15-4bbe-8666-00a2d27e7841?fileName=image.png" alt=Image><br> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19006','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-11 08:45:01.96+05:30','2024-07-11 08:45:01.96+05:30','2024-07-11 08:45:01.96+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14037','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19007','As a user, I would like to email/SMS state report','<div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/e86268df-cd76-42ba-8c38-d673fbad911c?fileName=image.png" alt=Image><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19007','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-11 09:00:56.17+05:30','2024-07-11 09:00:56.17+05:30','2024-07-11 09:00:56.17+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18373','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway');
INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:27:05.586715+05:30','19038','As a user, I would like to preview an image','<div><br> </div><div>Should be possible to mark </div><div><ul><li>Whether the image should be on the test report </li><li>Should be the cover image (Only one can be set at a time, so that others should be unselected) </li><ul><li>Or reordering we set the main image, and this is the same thing </li> </ul><li>Technical info: This section with checkbox could be included outside the base component with image preview </li><ul> </ul> </ul><div>Control buttons should be there </div><div><ul><li>Zoom in/out (We have this implemented on P3 TestLink) </li><li>Delete </li><li>Download </li><li>Edit (We have this on P2) </li> </ul> </div> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/d784bd37-1692-4c51-99f6-b7f2a495d2ed?fileName=image.png" alt=Image><br> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19038','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-07-11 21:05:33.967+05:30','2024-07-24 18:43:00.507+05:30','2024-07-24 18:43:00.507+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-24T13:13:00.507Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','19039','As a user, I would like to view the images on a slider','<div>We need to support read only mode by removing </div><div><ul><li>File uploader </li><li>Edit </li><li>Delete </li> </ul> </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/9b9b11a2-b59f-40c3-8dba-8d2efb8bcca0?fileName=image.png" alt=Image><br> </div><div><br> </div><div>In edit mode, when clicked on an image, we load the preview of that image </div><div><ul><li><a href="https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19038">https://dev.azure.com/SAMPLE-AS-Norway/BUS/_workitems/edit/19038</a><br> </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19039','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-07-11 21:25:11.327+05:30','2024-07-22 19:23:17.92+05:30','2024-07-22 19:23:17.92+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T13:53:17.92Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:25:36.879408+05:30','19047','As a PO, I want to adapt FileServer RestAPI in P2 Tasks in SuperAdmin','<ul><li>When a new file upload to tasks, it should upload to Azure blob storage </li><ul><li>Super Admin Task - <span style="font-size:14px;text-align:left;display:inline !important;">BUSkvalitet</span><span style="font-size:13px;outline:0px !important;color:rgb(41, 40, 39);font-family:az_ea_font, &quot;Segoe UI&quot;, az_font, system-ui, -apple-system, BlinkMacSystemFont, Roboto, Oxygen, Ubuntu, Cantarell, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;text-align:start;margin:0px 2px;">/</span><span style="font-size:13px;outline:0px !important;color:rgb(41, 40, 39);font-family:az_ea_font, &quot;Segoe UI&quot;, az_font, system-ui, -apple-system, BlinkMacSystemFont, Roboto, Oxygen, Ubuntu, Cantarell, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;text-align:start;">SuperAdminTasks/</span>&lt;Task_ID&gt;/ </li><li>Group Admin Tasks -&nbsp;BUSkvalitet/GroupAdminTasks/&lt;TASK_ID&gt;/ </li> </ul><li>When tasks are send from GA to Units, files should be copied to Unit''s tasks as well in below path: </li><ul><li>Unit Task - BUSkvalitet/Tasks/&lt;TASK_ID&gt;/<br> </li> </ul><li>This is applicable for all the files (file upload and google drive files) </li> </ul>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19047','{"category": "User Story"}',NULL,'{"category": "TQA In Progress"}',NULL,NULL,'2024-07-12 10:57:25.29+05:30','2024-07-26 11:02:01.467+05:30','2024-07-26 11:02:01.467+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-23T09:21:45.44Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-26T05:16:17.76Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-26T05:18:52.417Z"}, {"status": {"newValue": "TQA In Progress", "oldValue"