	('azure_workitems','2024-07-30 12:25:36.879408+05:30','19048','As a PO, I want to adapt FileServer RestAPI in P2 Tasks in BK App','<ul><li>When a new file upload to tasks, it should upload to Azure blob storage </li><ul><li>Tasks - BUSkvalitet/Tasks/&lt;Task_ID&gt;/ </li><li>Task Instance -&nbsp;BUSkvalitet/TaskInstances/&lt;TASK_INSTANCE_ID&gt;/ </li> </ul><li>This is applicable for all the files (image capture and upload file) </li> </ul><div><ul> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19048','{"category": "User Story"}',NULL,'{"category": "Business QA"}',NULL,NULL,'2024-07-12 10:58:58.577+05:30','2024-07-25 09:08:34.697+05:30','2024-07-25 09:08:34.697+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T09:29:25.39Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-07-23T09:21:00.247Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-23T09:32:20.003Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-25T03:38:34.697Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
