	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19054','As a user, I would like to have a damage drawing section','<div>Damage drawing section<br> </div><div><br> </div><div>Need to integrate a library (same one used on P2 or a better one)<br> </div><div><br> </div><div>Same as on P2 <a href="#" data-vss-mention="version:2.0,43faa749-cabc-6512-9b03-50de06c22b9e">@Oshadi Wattuhewa</a>&nbsp;? </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19054','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-13 13:26:26.45+05:30','2024-07-13 13:26:26.45+05:30','2024-07-13 13:26:26.45+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19195','As a developer, I would like to have more logs on the inspections flow','<div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">We may need some more logging on the sending part of inspections as well.</span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">This was identified in the troubleshoot work we did after the RT-July release (2024).</span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><ul><li><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">Anders was looking for any attempts to conclude inspections, but it looks like we skip directly from logging changing inspection to it has been processed.</span> </li> </ul></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><ul><li><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">Nothing about concluding or failures in between.</span> </li> </ul></span> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19195','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-18 00:00:52.26+05:30','2024-07-18 00:00:52.26+05:30','2024-07-18 00:00:52.26+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:05.586715+05:30','19222','As a developer, I want to add component for battery test results','<div><div style="box-sizing:border-box;">Show the battery test results.<br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">This is placed inside the General tab. </div><div style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/75ef1094-d4e5-47d2-a9a1-8e3163470556?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"> </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19222','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-22 10:04:29.007+05:30','2024-07-22 19:23:38.087+05:30','2024-07-22 19:23:38.087+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T04:40:17.46Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-22T06:05:34.24Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T13:15:08.987Z"}, {"status": {"newValue": "New", "oldValue": "Development In Progress"}, "changedAt": "2024-07-22T13:53:38.087Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway');
