:45:18.197+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-22T06:15:18.197Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18531','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:20:05.227858+05:30','17508','[SEO] As a developer, I want to update images','<div>More details in the parent Feature. This is part of the larger change for SEO. Tasks in this story: </div><div><ul><li><span>Review image alt tags and write better descriptions.</span> </li><li>Review images and compress additionally. Our images are already compressed, but there could be individual images that could be compressed more. </li><li><strike>Consider using other image formats, like webp (if supported by all browsers)</strike>&nbsp;since webp is supported only in newer Safari versions, not on older (before 2020), decided not to go with it. </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17508','{"category": "User Story"}',NULL,'{"category": "Business QA"}',NULL,NULL,'2024-05-31 12:46:06.77+05:30','2024-07-23 13:21:45.763+05:30','2024-07-23 13:21:45.763+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-03T12:34:44.523Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-06-05T12:17:11.837Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-06-10T05:22:00.633Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-13T09:48:23.487Z"}, {"status": {"newValue": "Blocked_QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-19T05:59:02.167Z"}, {"status": {"newValue": "Reopened", "oldValue": "Blocked_QA"}, "changedAt": "2024-07-02T03:54:40.877Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "Reopened"}, "changedAt": "2024-07-22T02:41:17.413Z"}, {"status": {"newValue": "Review", "oldValue": "Development In Progress"}, "changedAt": "2024-07-22T02:48:15.97Z"}, {"status": {"newValue": "In TQA", "oldValue": "Review"}, "changedAt": "2024-07-22T11:25:10.087Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-07-23T06:08:05.67Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-07-23T07:51:45.763Z"}]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17266','Azure-Workitems|SAMPLE-AS-Norway|monika.bijeikyte@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19264','[SEO] As a developer, I want to update images','<div><div style="box-sizing:border-box;">onMore details in the parent Feature. This is part of the larger change for SEO. Tasks in this story: </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">Review image alt tags and write better descriptions.</span> </li><li style="box-sizing:border-box;">Review images and compress additionally. Our images are already compressed, but there could be individual images that could be compressed more. </li><li style="box-sizing:border-box;"><strike style="box-sizing:border-box;">Consider using other image formats, like webp (if supported by all browsers)</strike>&nbsp;since webp is supported only in newer Safari versions, not on older (before 2020), decided not to go with it. </li> </ul> </div><br> </div><div>In&nbsp;&nbsp;<a href="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_workitems/edit/17508" data-vss-mention="version:1.0">#17508</a>, the changes were made to the first image in the Om Osacr page. </div><div>However, the change is not applied to the second, third and fourth images. </div><div><br> </div><div>Please find the suggested texts for the images in Om Oscar page </div><div><span>• Second Image : “Mekaniker utför bilinspektion under en bil”<br></span><div>• Third Image : “Två män diskuterar bilens skick vid bilhandlare”<br> </div><span>• Forth Image : “Sannolikhetsmätar</span><br> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19264','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-23 12:15:30.25+05:30','2024-07-23 12:15:30.25+05:30','2024-07-23 12:15:30.25+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17508','Azure-Workitems|SAMPLE-AS-Norway|chathusarat@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:14:43.085045+05:30','16424','As a PO, I need to keep the previous reference number as it is for Vipps payment receipts.(No need to update)',NULL,'https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/16424','{"category": "Bug"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-02 14:08:29.733+05:30','2024-05-06 12:43:55.647+05:30','2024-05-06 12:43:55.647+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-02T09:23:38.467Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-02T09:42:14.697Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-03T07:34:58.837Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-03T09:16:22.557Z"}, {"status": {"newValue": "Done", "oldValue": "Business QA"}, "changedAt": "2024-05-06T07:13:55.647Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|simon@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|159','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19269','As a PO, I want to do the necessary updates in Super Admin to comply with SVV''s new regulations','<div style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;"><span style="box-sizing:border-box;">From 1 January 2025, the control body must collect data on cars'' actual fuel consumption, so-called OBFCM data, when the cars are in for periodic checks. The control bodies must transfer this data to the Norwegian Road Administration. The Norwegian Public Roads Administration therefore wants the control body to be notified that a vehicle is applicable for reading and transferring OBFCM data, both when asking about control type and when creating a new control slip.&nbsp;</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/03757e33-4c27-449e-89cc-8004064e9815?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br style="box-sizing:border-box;"></span> </li> </ul></span> </div><div style="box-sizing:border-box;"><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">From 10 June 2024, a new field stating whether the data provider must display a warning will be available in our test environment. The field will provide information that a warning must be displayed in their solutions when creating a P control and for queries on control type for vehicles that must have P control, for petrol and diesel cars (including hybrid) in the categories M1 and N1 (including M1G and N1G ) which is registered for the first time as of 2021.<span>&nbsp;</span> </li><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><span style="box-sizing:border-box;">Text to be displayed:&nbsp;«Kjøretøyet er aktuelt for avlesning og overføring av OBFCM-data».</span> </li><li style="box-sizing:border-box;"><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;">Display a banner, same as how we display the protected vehicle&nbsp;</span> </li> </ul> </ul> </div> </div><br><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19269','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-23 14:52:57.957+05:30','2024-07-23 14:52:57.957+05:30','2024-07-23 14:52:57.957+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18134','Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19303','As an architect, I want to upgrade Telerik Reporting used both on P2 and P3','<div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">This is a main technology used in P2 and shared to P3 file server.</span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;"><br></span> </div><div><span style="color:rgb(29, 28, 29);font-family:Slack-Lato, Slack-Fractions, appleLogo, sans-serif;font-size:15px;text-align:left;display:inline !important;">It''s latest version is 2024 while we are still using v2019. Time to update it in our projects. Update place shall be in P2.</span><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19303','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-29 08:19:38.227+05:30','2024-07-29 08:19:38.227+05:30','2024-07-29 08:19:38.227+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|17929','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:29:52.678324+05:30','19304','As a user, I would like to copy a Test','<div>We discussed about sharing VehicleSnapshots when copying a Test/Test Run, however decided we should take this later, and consider only the basic flow now for the development.<br> </div><div><br> </div><div>This is created to discuss about these requirements in detail when copying Test/Test Run. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19304','{"category": "User Story"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-29 15:26:57.06+05:30','2024-07-29 15:26:57.06+05:30','2024-07-29 15:26:57.06+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|18892','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:27:41.714046+05:30','19313','As a PO, I want to adapt FileServer RestAPI in P2 Deviation','<ul><li>When a new file upload to deviation, it should upload to Azure blob storage </li><ul><li>Deviations - BUSkvalitet/Deviation/&lt;Deviation_ID&gt;/ </li> </ul><li>This is applicable for all the files (file upload and google drive files) </li> </ul><div><ul> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19313','{"category": "User Story"}',NULL,'{"category": "Development In Progress"}',NULL,NULL,'2024-07-30 09:41:51.41+05:30','2024-07-30 09:45:03.473+05:30','2024-07-30 09:45:03.473+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-07-30T04:15:03.473Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
