ox-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">150 - Vurdering av unormal slitasjon </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">8 - eierskifte kontroll </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">3 - Funksjonstest </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">165 - Teknisk kontroll </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">167 - Sikkerhetskontroll veteranbiler </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);"><br> </div><div style="box-sizing:border-box;margin:0px;color:rgba(0, 0, 0, 0.9);">New changes will not be applied for Swedish report. Swedish report will be as it is today </div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17260','{"category": "User Story"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-05-22 18:14:26.58+05:30','2024-05-28 18:59:54.577+05:30','2024-05-28 18:59:54.577+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-05-27T03:34:26.27Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-27T10:43:36.36Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-27T10:46:25.43Z"}, {"status": {"newValue": "Development In Progress", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-27T13:12:15.71Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-05-28T03:50:47.66Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-05-28T06:00:43.107Z"}, {"status": {"newValue": "Business QA", "oldValue": "TQA In Progress"}, "changedAt": "2024-05-28T07:48:48.05Z"}, {"status": {"newValue": "UAT", "oldValue": "Business QA"}, "changedAt": "2024-05-28T10:56:10.397Z"}, {"status": {"newValue": "Done", "oldValue": "UAT"}, "chan