	('azure_workitems','2024-07-30 12:21:35.408558+05:30','17795','As an Architect, I want to fix issue in token validation in P3 Kompetanse ','<div>we are assuming all tokens sent to BUS Kvalitet API must be from P2 with token.businessToken.<br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/4ec6c2e1-9cdc-478b-87d5-a89a1570fc57?fileName=image.png" alt=Image><br> </div><div><br> </div><div>When directly applying for a token on Security Portal, without inputting additionalInfo to generate businessToken, the above codes will simply fail, as we didn''t run NULL check.<br> </div><div><br> </div><div>It throws an exception inside OnTokenValidated, that''s why it couldn''t pass validating a token while the token is even valid. &nbsp; &nbsp; &nbsp; <br> </div><div><br> </div><div><b>Solution: </b>Fix this bug with NULL &amp; empty string check.<br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/17795','{"category": "Bug"}',NULL,'{"category": "Done"}',NULL,NULL,'2024-06-06 00:40:37.95+05:30','2024-06-27 08:52:25.66+05:30','2024-06-27 08:52:25.66+05:30','[{"status": {"newValue": "Development In Progress", "oldValue": "New"}, "changedAt": "2024-06-20T05:02:21.39Z"}, {"status": {"newValue": "In TQA", "oldValue": "Development In Progress"}, "changedAt": "2024-06-20T08:29:02.803Z"}, {"status": {"newValue": "TQA In Progress", "oldValue": "In TQA"}, "changedAt": "2024-06-24T06:15:55.67Z"}, {"status": {"newValue": "Done", "oldValue": "TQA In Progress"}, "changedAt": "2024-06-27T03:22:25.66Z"}]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|ShamiqueF@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|176','Azure-Workitems|SAMPLE-AS-Norway'),
