	('azure_workitems','2024-07-30 12:30:53.449807+05:30','19301','As a QA, I want to upload images with file size over 10MB into BUStest Valuations','<div><b>Observation:<br></b>When trying to create valuation in BUStest IOS Safari, user get black image when trying to upload images with file size over 10MB at valuation checkpoints creation. The black images can be again viewed in valuation reports. Below 10MB images can be viewed without any issue.<br><br>This issue is visible in both non-Viking and Viking users. </div><div><br> </div><div>This issue can be recreated at production IOS Safari level too. </div><br><b>Steps:<br></b><div><ol><li>Create a personbil bustest valuation as a non-Viking/Viking user. </li><li>Add defect at valuation checkpoints by uploading image over 10MB. </li><li>Upload valuation general images over 10MB. </li><li>Observe in both locations'' images get upload as black backgrounds/images. </li> </ol> </div><br><b>Expected Result:<br></b><div>User should be view images in their original state/view. </div><br><b>Actual Result:<br></b><div>At adding defects to valuation checkpoints </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/aa22d783-9ae3-4a8d-b9dd-9e6b039c4183?fileName=image.png" alt=Image style="width:342px;height:233px;" width=342 height=233><br> </div><div>At valuation reports<br><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/0fef9bd8-61c3-49be-9a83-f5b08116fc1a?fileName=image.png" alt=Image style="width:328px;height:326px;" width=328 height=326><br> </div><br><div><b>System Info(OS/Browser Version,Device): IOS Safari</b><br> </div><b>Test Data:<br></b><div>images with file size over 10MB </div><br><b>Impact (to be filled out by developer)</b><br>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/19301','{"category": "Bug"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-25 14:20:53.887+05:30','2024-07-25 14:20:53.887+05:30','2024-07-25 14:20:53.887+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|RidmiN@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|181','Azure-Workitems|SAMPLE-AS-Norway'),
