INSERT INTO "tms_Task" ("origin","refreshedAt","uid","name","description","url","type","priority","status","points","additionalFields","createdAt","updatedAt","statusChangedAt","statusChangelog","source","parent","creator","epic","sprint","organization") VALUES ('azure_workitems','2024-07-30 12:30:53.449807+05:30','18126','Services Integration','<div> </div><div style="box-sizing:border-box;">This is to support the APIs exposed to external partners for BUStest. </div><div style="box-sizing:border-box;"><br style="box-sizing:border-box;"> </div><div style="box-sizing:border-box;">We may not be able to migrate everything together, so that need a plan to support both P2 and P3 APIs in parallel </div><div style="box-sizing:border-box;"><ul style="box-sizing:border-box;padding:0px 0px 0px 40px;"><li style="box-sizing:border-box;">Based on the external partners who are using P3, we can create only the required APIs initially </li> </ul><div>On P2, we have very specific codes to handle security (Eg: if Viking do like this etc.) </div><div>On P3, we go with standard API methods </div><div><br> </div><div>To achieve this, we can use the below permission related tables on SecurityPortal DB. So, we grant access based on permission / resource model. </div><div><br> </div><div><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/04f882fc-2e89-46af-af8f-db69079c2eff?fileName=image.png" alt=Image><br> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18126','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-14 08:56:49.003+05:30','2024-06-14 08:56:49.003+05:30','2024-06-14 08:56:49.003+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18130','File Storage Integration','<div>For the file uploads we will use Azure. </div><div><br> </div><div>We have separate stories to handle this, but this is to address any requirements we need specifically to BUStest. </div><div><ul><li>No need any adaptations on P2 </li><li>Should be able to use APIs to CRUD operations on file </li> </ul><div>We need to finalize the folder structure to keep the shared images among multiple entities </div><div><ul><li>Eg: Images shared among valuations and state report </li> </ul><div><br> </div><div>Notes: </div><div><ul><li>We are not using base64 in APIs, but byte arrays </li><li>In case when we need to have the base64, we could use a utility on client side </li><li>When generating the thumbnails, we can generate it in the client side, without sending the image to server side and getting the thumbnail back </li> </ul> </div> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18130','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-14 09:32:10.28+05:30','2024-06-14 09:32:10.28+05:30','2024-06-14 09:32:10.28+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18134','As a PO, I want to do the necessary updates in BUSpek to comply with SVV''s new regulations','<div><span style="box-sizing:border-box;color:rgba(0, 0, 0, 0.9);font-size:15px;"><ul><li><span style="box-sizing:border-box;">From 1 January 2025, the control body must collect data on cars'' actual fuel consumption, so-called OBFCM data, when the cars are in for periodic checks. The control bodies must transfer this data to the Norwegian Road Administration. The Norwegian Public Roads Administration therefore wants the control body to be notified that a vehicle is applicable for reading and transferring OBFCM data, both when asking about control type and when creating a new control slip.&nbsp;</span> </li><li><span style="box-sizing:border-box;"><img src="https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/attachments/03757e33-4c27-449e-89cc-8004064e9815?fileName=image.png" alt=Image style="box-sizing:border-box;max-width:100%;align-self:center;"><br></span> </li> </ul></span> </div><div><div style="box-sizing:border-box;"><ul><li style="color:rgba(0, 0, 0, 0.9);font-size:15px;">From 10 June 2024, a new field stating whether the data provider must display a warning will be available in our test environment. The field will provide information that a warning must be displayed in their solutions when creating a P control and for queries on control type for vehicles that must have P control, for petrol and diesel cars (including hybrid) in the categories M1 and N1 (including M1G and N1G ) which is registered for the first time as of 2021. </li><ul><li style="color:rgba(0, 0, 0, 0.9);font-size:15px;"><span>Text to be displayed:&nbsp;«Kjøretøyet er aktuelt for avlesning og overføring av OBFCM-data».</span> </li><li><span style="color:rgba(0, 0, 0, 0.9);font-size:15px;">Display a banner, same as how we display the protected vehicle&nbsp;</span> </li><li><span style="color:rgba(0, 0, 0, 0.9);font-size:15px;">Text should display in inspection creation popup, edit </span><span style="color:rgba(0, 0, 0, 0.9);font-size:15px;">inspection</span><span style="color:rgba(0, 0, 0, 0.9);font-size:15px;">&nbsp;and vehicle search (same as the protected vehicle)</span> </li> </ul><li style="color:rgba(0, 0, 0, 0.9);font-size:15px;"><span style="text-align:start;display:inline !important;">We need this change in the BUSpek app as well.</span> </li><li style="color:rgba(0, 0, 0, 0.9);font-size:15px;">We need this change for sample inspection as well. </li><li style="color:rgba(0, 0, 0, 0.9);font-size:15px;">Need DB Changes <a href="#" data-vss-mention="version:2.0,19b8c663-a32b-607a-bcf6-adbbf400a94b">@Anders Aanje</a>&nbsp;/ <a href="#" data-vss-mention="version:2.0,e01c7883-70a2-612f-aa68-d77ac340e44d">@Ishara Kumararathna</a>&nbsp; </li><ul><li style="color:rgba(0, 0, 0, 0.9);font-size:15px;">DB Change should be done on VehicleSnapshot and as well as on AutoSysDummyVehicle table&nbsp; </li> </ul> </ul> </div> <div><br> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18134','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-14 10:10:08.717+05:30','2024-06-14 10:10:08.717+05:30','2024-06-14 10:10:08.717+05:30','[]','Azure-Workitems',NULL,'Azure-Workitems|SAMPLE-AS-Norway|SamraA@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18373','Sales report - state report','<div>On SW, we should have both state report and VDN as it''s now on P2. </div><div><br> </div><div>Should be able to customize state report. </div><div><ul><li>Logos etc. </li> </ul><div>Keep the same flow as it''s now, and the UI would be different on P3. </div><div><ul><li>Possible to create state report without having a valuation </li><ul><li>Since we can create work orders freshly, we can create a state report based on such work order as well - we should be able to create a state report in parallel with work order, and as work orders has the progress, the state report also be updated </li> </ul><li>Showing the defects is same as now </li> </ul><div>One state report based on previous item, but there could be different other sales reports (Eg: VDN apart from the state report). </div><div><ul><li>In future there could be different other sales report types as well </li> </ul> </div> </div> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18373','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-20 14:47:06.247+05:30','2024-06-20 14:47:06.247+05:30','2024-06-20 14:47:06.247+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|vidar@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:30:53.449807+05:30','18374','Statistics','<div>This is about the data we like to track. </div><div><br> </div><div>Things we need to consider <a href="#" data-vss-mention="version:2.0,4cd9de16-d0f9-635e-b832-5dae4a09cd59">@Vidar Jaeck</a>&nbsp;<a href="#" data-vss-mention="version:2.0,3305a97a-c961-6eab-aa20-e2d5338efc25">@Simon Ahlberg</a>&nbsp;would finalize. </div><div><br> </div><div>Consider these ones when designing the DB <a href="#" data-vss-mention="version:2.0,19b8c663-a32b-607a-bcf6-adbbf400a94b">@Anders Aanje</a>&nbsp; </div><div><ul><li>We could optimize the DB to make this easier, specially supporting better performance </li><li>Get ideas from <a href="#" data-vss-mention="version:2.0,882eaab5-a486-659f-817b-faed3b5f34d7">@Nethmal Warusamana</a>&nbsp;from big data perspective </li> </ul> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18374','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-20 14:47:28.227+05:30','2024-06-20 14:47:28.227+05:30','2024-06-20 14:47:28.227+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|vidar@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:28:46.170651+05:30','18480','BUStest grids','<div>Apart from the grids we already have within the main flow, ie: search a vehicle and we see the data related to that vehicle </div><div><ul><li>Active tests </li><li>Active work orders </li><li>Active state reports </li><li>Grids for historical records as well </li> </ul><div>Need to decide on what should be the default set of data. </div> </div><div>Any other columns we need to allow for users to add additionally. </div><div><br> </div><div>Technical info for the customizations </div><div><ul><li>These customizations could be saved on Azure as a configuration files </li><li>It could be a json file related to a group, unit, or an individual user </li><li>To be discussed later </li> </ul> </div><div><br> </div><div>Filtrations we need to finalize. </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18480','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-26 12:04:34.983+05:30','2024-06-26 12:04:34.983+05:30','2024-06-26 12:04:34.983+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:30:53.449807+05:30','18642','BUStest Notifications','<div>Email/sms notifications (realtime, daily)<br> </div><div><ul><li>No daily notifications </li> </ul> </div><div> </div><div>App notifications </div><div><br> </div><div><b>Scenarios</b> </div><div><ul><li>When concluding a valuation </li><li>Work order related ones </li><li>... </li><li>To be finalized in detail </li> </ul> </div><div><br> </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18642','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-06-30 11:28:11.49+05:30','2024-06-30 11:28:11.49+05:30','2024-06-30 11:28:11.49+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
	('azure_workitems','2024-07-30 12:30:53.449807+05:30','18811','BUStest reports','<div>Any new reports than the current ones? </div><div><br> </div><div>For the current ones, are we using Telerik? </div>','https://dev.azure.com/SAMPLE-AS-Norway/538331ca-b668-420f-9158-4757e1406d14/_apis/wit/workItems/18811','{"category": "Feature"}',NULL,'{"category": "New"}',NULL,NULL,'2024-07-04 14:06:04.677+05:30','2024-07-04 14:06:04.677+05:30','2024-07-04 14:06:04.677+05:30','[]','Azure-Workitems','Azure-Workitems|SAMPLE-AS-Norway|14024','Azure-Workitems|SAMPLE-AS-Norway|NuwanS@flowyzer-sample.io',NULL,'Azure-Workitems|SAMPLE-AS-Norway|55','Azure-Workitems|SAMPLE-AS-Norway'),
